            CREATE TABLE IF NOT EXISTS `translations` (
                `translation` VARCHAR(255) PRIMARY KEY,
                `title` VARCHAR(255),
                `license` TEXT
            );
            

            SELECT 'ManxGaelic', '# ManxGaelic: Manx Gaelic Scripture Portions', 'Public Domain'
            WHERE NOT EXISTS (
                SELECT 1 FROM `translations` WHERE `translation` = 'ManxGaelic'
            );
            

            CREATE TABLE `ManxGaelic_books` (
                `id` INT AUTO_INCREMENT PRIMARY KEY,
                `name` VARCHAR(255)
            );
            

            CREATE TABLE `ManxGaelic_verses` (
                `id` INT AUTO_INCREMENT PRIMARY KEY,
                `book_id` INT,
                `chapter` INT,
                `verse` INT,
                `text` TEXT,
                FOREIGN KEY (book_id) REFERENCES `ManxGaelic_books`(id)
            );
            
