INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 1, 'Lioar sheeloghe Yeesey Creest, mac Ghavid, mac Abraham');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 2, 'Hooar Abraham Isaac, as hooar Isaac Jacob, as hooar Jacob Judas as e vraaraghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 3, 'As hooar Judas Phares as Zarah rish Thamar, as hooar Phales Esrom, as hooar Esrom Aram.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 4, 'As hooar Aram Aminadab, as hooar Aminadab Naason, as hooar Naason Salmon');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 5, 'As hooar Salmon Booz rish Rachab, as hooar Booz Obed rish Ruth, as hooar Obed Jesse.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 6, 'As hooar Jesse David yn ree, as hooar David yn ree Solomon reeish v\'er ny ve ben Urias.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 7, 'As hooar Solomon Roboam, as hooar Roboam Abia, as hooar Abia Asa:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 8, 'As hooar Asa Josaphat, as hooar Josaphat Joram, as hooar Joram Ozias.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 9, 'As hooar Ozias Joatham, as hooar Joatham Achaz, as hooar Achaz Ezekias.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 10, 'As hooar Ezekias Manasses, as hooar Manasses Amon, as hooar Amon Josias.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 11, 'As hooar Josias Jechonias as e vraaraghyn, mysh traa yn chappeeys Babylonagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 12, 'As rish earish yn chappeeys Babylon agh hooar Jechonias Salathiel, as hooar Salathiel Zorobabel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 13, 'As hooar Zorobabel Abiud, as hooar Abiud Eliakim, as hooar Eliakim Azor.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 14, 'As hooar Azor Sadoc, as hooar Sadoc Achim, as hooar Achim Eliud.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 15, 'As hooar Eliud Eliazar, as hooar Eliazar Matthan, as hooar Matthan Jacob.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 16, 'As hooar Jacob Joseph sheshey Voirrey, j\'eeish ruggyr Yeesey, ta enmyssit Creest.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 17, 'Myr shen ta ooilley ny sheelogheyn veih Abraham gys David, kiare sheelogheyn jeig: as veih David derrey\'n chappeeys ayns Babylon, kiare sheelogheyn jeig: as veih\'n chappeeys ayns Babylon derrey Creest kiare sheelogheyn jeig.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 18, 'Nish shoh myr haink (Yeesey) Creest er y theihll: Erreish da e voir Moirrey ve nasht rish Joseph, roish my daink ad dy vaghey cooidjagh, v\'ee ry-akin dy ve corrym liorish yn Spyrryd Noo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 19, 'As myr va Joseph e sheshey ny ghooinney cairal, as neu-wooiagh dy choyrt ee gys nearey foshlit, v\'eh smooinaghtyn dy scarrey');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 20, 'Agh choud as va ny reddyn shoh er e aigney, cur-my-ner haink ainle y Chiarn huggey ayns ashlish, gra, Yoseph, vac Ghavid, ny bee aggle ort dy ghoaill hood Moirrey dty ven: son shen t\'er ny ghientyn aynjee, te jeh\'n Spyrryd Noo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 21, 'As ver ee mac son y theihll, as nee oo genmys eh Yeesey, son sauee eh e phobble veih nyn beccaghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 22, '(Shoh myr va er ny chooilleeney ooilley ny loayr y Chiarn liorish y phadeyr, gra');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 23, 'Cur-my-ner nee moidyn gientyn, as ver ee mac son y theihll, as nee ad genmys eh Emmanuel, ta shen dy ghra, Jee marin.)');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 24, 'Tra va Joseph eisht er n\'irree veih cadley, ren eh myr va ainle y Chiarn er chur roish, as ghow eh thie e ven:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 1, 25, 'As cha row veg echey dy yannoo r\'ee, derrey hug ee e ynrycan mac son y theihll, as denmys eh yn ennym echey Yeesey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 1, 'Nish tra rug Yeesey ayns Bethlehem dy Yudea, rish lhing ree Herod, cur-my-ner haink deiney-creeney veih\'n shiar gys Jerusalem,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 2, 'Gra, Cre vel ree ny Hewnyn t\'er jeet er y theihll? son honnick shin y rollage echey ayns y shiar, as ta shin er jeet dy chur ooashley da.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 3, 'Tra cheayll ree Herod shoh, v\'eh dy mooar seaghnit, as ooilley Jerusalem marish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 4, 'As tra v\'eh er symney cooidjagh ooilley ny ard-saggyrtyn, as scrudeyryn y phobble, denee eh jeu cre\'n raad va Creest dy heet er y theihll.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 5, 'As dooyrt adsyn rish, Ayns Bethlehem dy Yudea: son shoh myr te scruit liorish y phadeyr:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 6, 'As uss Vethlehem ayns cheer Yudea, cha nee oo sloo ta mastey princeyn Yuda: son assyd\'s hig Kiannoort nee reill my phobble Israel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 7, 'Eisht hug Herod fys follit er ny deiney creeney, as deysht eh ad dy imneagh mychione y traa haink yn rollage rish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 8, 'As hug eh ad gys Bethlehem, gra, Immee-jee, as shir-jee magh dy jeidjagh son y lhiannoo, as tra vees shiu er gheddyn magh eh, tar-jee lesh fys hym\'s, dy voddym\'s neesht cheet as ooashley \'choyrt da.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 9, 'Erreish daue v\'er chlashtyn y ree, jimmee ad rhymboo, as cur-my-ner hie yn rollage honnick ad ayns y shiar er e toshiaght roue, derrey haink ee, as hass ee erskyn yn ynnyd raad va\'n lhiannoo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 10, 'Tra honnick ad y rollage, va boggey erskyn-towse orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 11, 'As goll stiagh \'sy thie, hooar ad y lhiannoo marish Moirrey e voir, as gliooney sheese, hug ad ooashley da as fosley ny tashtaghyn oc, heb ad giootyn da; airh, as frankincense, as myrrh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 12, 'As myr va Jee er chur raaue daue ayns ashlish, gyn ad dy hyndaa gys Herod, ghow ad raad elley gys nyn jeer hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 13, 'As tra v\'ad er n\'immeeaght, cur-my-ner haink ainle y Chiarn gys Joseph ayns ashlish, gra, Trog ort, gow yn lhiannoo as e voir, cosne royd gys Egypt, as fuirree ayns shen derrey ver-yms fys hood: son shirree Herod y lhiannoo dy stroie eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 14, 'Eisht dirree eh, as ghow eh yn lhiannoo, as e voir ayns yn oie, as hie eh roish er-chea gys Egypt:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 15, 'As shen-y raad v\'eh derrey baase Herod: as shoh myr va cooilleenit shen loayr y Chiarn liorish y phadeyr, gra, Magh ass Egypt deie mee er my vac.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 16, 'Eisht Herod toiggal dy row eh mollit liorish ny deiney-creeney, v\'eh erskyn-towse eulyssagh, as hug eh magh sarey, as varr eh ooilley ny lhiennoo-mec v\'ayns Bethlehem, as ayns ooilley ny ardjyn shen, veih daa vlein dy eash as fo, corrym rish y traa v\'eh dy imneagh er vriaght jeh ny deiney creeney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 17, 'Shen y traa va cooilleenit ny va loayrit liorish Jeremy yn phadeyr, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 18, 'Ayns Rama va eam treih er ny chlashtyn, yllaghey as keayney, as dobberan hrimshagh, Rachel keayney son e cloan, as gobbal dy ve er ny gherjaghey, er-yn-oyr nagh row ad er-mayrn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 19, 'Agh lurg baase Herod, cur-my-ner haink ainle y Chiarn ayns ashlish gys Joseph ayns Egypt,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 20, 'Gra, Irree, as gow yn lhiannoo as e voir, as immee gys cheer Israel: son t\'adsyn marroo va shleeuit er bioys y lhiannoo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 21, 'As dirree eh, as ghow eh yn lhiannoo as e voir, as haink eh gys cheer Israel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 22, 'Agh clashtyn dy row Archelaus reill ayns Judea, ayns ynnyd e ayr Herod, va aggle er dy gholl gys shen: agh myr va Jee er chur roish ayns ashlish, hyndaa eh gys ardjyn Ghalilee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 2, 23, 'As jimmee eh dy chummal ayns ard-valley enmyssit Nazareth: as shoh myr va cooilleenit shen loayr ny phadeyryn, Bee eh enmyssit ny Nazarene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 1, 'Ayns ny laghyn shen haink Ean Bashtey, preacheil ayns faasagh Yudea,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 2, 'As gra, Gow-jee arrys: son ta reeriaght Yee er gerrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 3, 'Son shoh eshyn va loayrit jeh liorish y phadeyr Esaias, gra, Coraa fer geamagh ayns yn aasagh, Kiartee-jee raad y Chiarn, jean-jee ny cassanyn echey jeeragh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 4, 'As v\'ec Ean cheddin coamrey dy fynney chamel, as cryss liare mysh e veeghyn; as va e veaghey locustyn as mill feie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 5, 'Eisht hie magh huggey Jerusalem as ooilley Judea, as Ooilley yn cheer mygeayrt Jordan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 6, 'As goaill-rish nyn beccaghyn v\'ad er nyn mashtey liorish ayns Jordan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 7, 'Agh tra honnick eh ymmodee jeh ny Phariseeyn as ny Sadduceeyn cheet gys e vashtey, dooyrt eh roo, O shiuish heeloghe dy ard-nieughyn, quoi t\'er chur raaue diu dy hea veih yn jymmoose ta ry-heet?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 8, 'Cur-jee magh nish er-y-fa shen messyn cooie dy arrys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 9, 'As ny smooinee-jee dy ghra, riu hene, Ta Abraham ain son nyn ayr: son ta mee gra riu, dy vel Jee pooaral eer jeh ny claghyn shoh dy hroggal seose cloan da Abraham');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 10, 'As nish hene ta\'n teigh er ny choyrt gys fraue ny biljyn: shen-y-fa ta dy chooilley villey nagh vel gymmyrkey magh mess mie, dy ve giarit sheese as tilgit ayns yn aile.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 11, 'Ta mish dy jarroo bashtey shiu lesh ushtey gys arrys: agh t\'eshyn ta cheet my yei ny s\'pooaral ny mish, ny braagyn echey cha vel mee feeu dy ymmyrkey: bashtee eshyn shiu lesh y Spyrryd Noo as lesh aile.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 12, 'Ta\'n cleayst echey ayns e laue, as nee eh dy bollagh e laare-vooie y ghlenney, as gowee eh e churnaght stiagh ayns e hie-tashtee: agh loshtee eh yn choau lesh aile nagh bee er ny vooghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 13, 'Eisht haink Yeesey veih Galilee gys Jordan, dy ve bashtit liorish Ean.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 14, 'Agh va Ean noi shen, gra, Ta feme aym\'s dy ve er my vashtey liort\'s, as vel uss cheet hym\'s?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 15, 'Dreggyr Yeesey, as dooyrt eh rish, Cur raad dou nish: son shoh myr te cooie dooin dy chooilley chairys y chooilleeney. Eisht lhig eh da.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 16, 'As lurg da Yeesey ve bashtit, hie eh seose jeeragh ass yn ushtey: as cur-my-ner va ny niaughyn er nyn vosley er-e-skyn, as honnick eh Spyrryd Yee cheet neose myr calmane, as soie er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 3, 17, 'As cur-my-ner, coraa veih niau, gra, Shoh my vac ennoil, jeh ta mee dy mooar soiaghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 1, 'Eisht va Yeesey er ny leeideil liorish Spyrryd Yee gys yn aasagh, dy v\'er ny violaghey liorish y drogh-spyrryd.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 2, 'As tra v\'eh er drostey da-eed laa as da-eed oie v\'eh ny lurg shen accryssagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 3, 'As haink y mioleyder huggey, gra, My she mac Yee oo, cur sarey da ny claghyn shoh dy ve jeant nyn arran.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 4, 'Agh dreggyr eshyn, gra, Te, scruit, Cha nee liorish arran ny lomarcan nee dooinney beaghey, agh liorish dy chooilley ockle ta cheet magh ass beeal Yee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 5, 'Eisht ghow y drogh-spyrryd lesh seose eh gys yn ard-valley casherick, as hoie eh eh er beinn toor syrjey yn chiamble,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 6, 'As dooyrt eh rish, My she Mac Yee oo tilg oo hene sheese: son te scruit, Ver eh currym da e ainleyn my-dty-chione, as ayns nyn laueyn nee ad oo y ymmyrkey, nagh bwoaill oo ec traa erbee dty chass noi chlagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 7, 'Dooyrt Yeesey rish, Te scruit myrgeddin, Cha jean oo yn Chiarn dty Yee y violaghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 8, 'Reesht hug y drogh-spyrryd lesh eh seose er slieau feer ard, as yeeagh eh da ooilley reeriaghtyn y theihll as y ghloyr oc:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 9, 'As dooyrt eh rish, Ooilley shoh ver-ym\'s dhyt\'s, my huittys oo sheese, as ooashley chur dou.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 10, 'Eisht dooyrt Yeesey rish, Ass my enish oo, Noid-ny-hanmey: son te scruit, Ver oo ooashley da\'n Chiarn dty Yee, as eshyn ynrycan nee oo shirveish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 11, 'Eisht daag y drogh-spyrryd eh, as cur-my-ner haink ainleyn as ren ad shirveish er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 12, 'Nish tra cheayll Yeesey dy row Ean ny phryssoonagh, jimmee eh dy lhiattee gys Galilee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 13, 'As faagail Nazareth, haink eh dy chummal ayns Capernaum, ta rish oirr ny marrey, rish ardjyn Zabulon as Nephthalim:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 14, 'As shoh myr va cooilleenit shen ny loayr Esaias yn phadeyr, gra');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 15, 'Thalloo Zabulon, as thalloo Nephthalim, er slyst ny marrey, cheu elley dy Yordan, Galilee ny Ashoonee:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 16, 'Ta\'n pobble va nyn soie ayns dorraghys, er vakin soilshey mooar: as orroosyn va nyn soie ayns cheer as scadoo\'n vaaish, ta soilshey er n\'irree seose.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 17, 'Veih yn traa shen ren Yeesey toshiaght dy phreacheil, as dy ghra, Gow-jee arrys, son ta reeriaght niau er-gerrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 18, 'As myr va Yeesey shooyl liorish keayn Ghalilee, honnick eh daa vraar, Simon va enmyssit Peddyr, as Andreays e vraar, cur magh lieen \'sy cheayn: (son v\'ad nyn eeasteyryn)');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 19, 'As dooyrt eh roo, Eiyr-jee orrym\'s, as neem\'s shiu nyn eeasteyryn dy gheiney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 20, 'As chelleeragh daag ad nyn lieenteenyn, as deiyr ad er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 21, 'As goll er e hoshiaght veih shen, honnick eh daa vraar elley, Jamys mac Zebedee as Ean e vraar, ayns lhong marish Zebedee nyn ayr, karraghey nyn lieen: as deie eh orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 22, 'As chelleeragh daag ad y lhong as nyn ayr, as deiyr ad er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 23, 'As hie Yeesey mygeayrt ooilley Galilee, gynsaghey ayns nyn gialteenyn, as preacheil sushtal y reeriaght, as lheihys dy chooilley hingys, as dy chooilley ghoghan mastey\'n pobble.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 24, 'As hie goo jeh magh trooid ooilley Syria: as hug ad lhieu huggey ooilley ny aslayntee, fo doghanyn as pianyn, adsyn va seaghnit lesh drogh-spyrrydyn, sleih ass nyn geeayl, as an-lheiltee, as ren eh ad y lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 4, 25, 'As deiyr er chaglym mooar dy leih veih Galilee, as Decapolis, as Jerusalem, as Judea, as veih cheu elley dy Yordan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 1, 'As fakin lheid ny earrooyn dy leih, hie eh seose er slieau: as tra v\'eh er hoie sheese, haink e ynseydee huggey');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 2, 'As hrog eh seose e choraa, as dynsee eh ad, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 3, 'Bannit t\'adsyn ta imlee ayns spyrryd: son lhieusyn reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 4, 'Bannit t\'adsyn ta dobberan: son bee ad er nyn gherjaghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 5, 'Bannit t\'adsyn ta meen surransagh: son bee yn thalloo oc ayns eiraght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 6, 'Bannit t\'adsyn ta accryssagh as paagh lurg yn ynrickys: son bee ad er nyn yannoo magh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 7, 'Bannit ta\'n vooinjer vyghinagh: son bee myghin er ny hoilshaghey daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 8, 'Bannit t\'adsyn ta glen ayns cree: son ver ad Jee my-ner.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 9, 'Bannit t\'adsyn ta tayrn sleih gys shee: son bee ad enmyssit nyn gloan dy Yee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 10, 'Bannit t\'adsyn ta surranse tranlaase er graih cairys: son lhieusyn reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 11, 'Bannit ta shiuish tra vees shiu oltooanit, as tranlaasit, as dy chooilley ghrogh-ghoo currit ass nyn lieh dy aggairagh er y choontey aym\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 12, 'Gow-jee boggey, as bee-jee erskyn towse gennal: son s\'mooar ta nyn leagh ayns niau: son shoh myr ren ad tranlaase er ny phadeyryn va rhymbiu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 13, 'Shiuish sollan y thallooin: agh my ta\'n sollan er choayl e vlass, kys hig e vree ayn reesht? cha vel ymmyd erbee sodjey ny chour, agh dy ve tilgit magh, as stampit fo cassyn deiney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 14, 'Shiuish soilshey yn theihll Cha vod ard-valley ta soit er cronk ve follit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 15, 'Chamoo ta sleih foaddey cainle, as dy choyrt ee fo saagh; agh ayns cainleyr, as t\'ee cur soilshey da\'n slane lught-thie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 16, 'Lhig da\'n soilshey euish myr shen soilshean fenish deiney, dy vod ad fakin ny obbraghyn mie eu, as gloyr y choyrt da nyn ayr t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 17, 'Ny smooinee-jee dy daink mish dy chur naardey yn leigh as ny phadeyryn: cha nee dy chur naardey haink mee, agh dy chooilleeney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 18, 'Son dy firrinagh ta mee gra riu, Derrey nee yn aer as yn ooir lheie ersooyl, cha bee un ockle, ny\'n floag sloo er ny ghoaill veih\'n leigh, derrey vees ooilley jeant mie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 19, 'Quoi-erbee er-y-fa shen vrishys unnane jeh ny annaghyn sloo shoh, as ynsys myr shen, bee eh enmyssit yn fer sloo ayns reeriaght niau: agh quoi erbee nee nyn yannoo as nyn ynsaghey, bee eh enmyssit mooar ayns reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 20, 'Son ta mee gra riu, Mannagh bee yn ynrickys euish erskyn ynrickys ny Scrudeyryn as ny Phariseeyn, cha vod shiu er aght erbee goll stiagh ayns reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 21, 'Ta shiu er chlashtyn dy row eh er ny ghra rish nyn shenn-ayryn, Cha jean oc dunverys: as quoi-erbee nee dunverys, hig eh fo kerraghey yn vriwnys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 22, 'Agh ta mish gra riuish, Quoi-erbee ta fargagh rish e vraar gyn oyr, dy jig eshyn neesht fo kerraghey yn vriwnys: as quoi erbee jir rish e vraar, Raca: dy jig eh fo briwnys yn ard-whuaiyl: agh quoi-erbee jir, Uss ommydan, dy bee eh ayns gaue aile niurin,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 23, 'Shen-y-fa tra hebbys oo dty oural ec yn altar, my chooinys oo ayns shen dy vel nhee erbee ec dty vraar dt\'oi');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 24, 'Faag ayns shen dty oural roish yn altar, as immee royd, jean coardail rish dty vraar hoshiaght, as eisht tar, as cheb dty oural.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 25, 'Coard dy tappee rishyn ta streeu rhyt, choud as vees shiu goll cooidjagh er y raad, er-aggle dy der eshyn oo fo laue yn vriw, as dy der yn briw oo fo currym y tidoor, as dy bee oo tilgit ayns pryssoon.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 26, 'Dy firrinagh ta mee gra rhyt, Nagh jig oo magh ass shen, derrey t\'ou er n\'eeck yn farling s\'jerree.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 27, 'Ta shiu er chlashtyn dy row eh er ny ghra rish nyn shenn-ayryn, Cha brish oo poosey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 28, 'Agh ta mish gra riu, Quoi-erbee ta jeeaghyn er ben, dy chur saynt j\'ee, dy vel eh er vrishey poosey r\'ee hannah ayns e chree.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 29, 'As my ta dty hooill yesh dy dty hayrn gys peccah, pluck assyd ee, as tilg void ee: son te ny share dhyt unnane jeh dty hooillyn y choayl, na dty slane corp dy ve tilgit ayns niurin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 30, 'As my ta dty laue yesh dy dty hayrn gys peccah, giare jeed, as tilg void ee: son te ny share dhyt unnane jeh dty oltyn y choayl, na dty slane corp dy ve tilgit ayns niurin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 31, 'Ve er ny ghra, Quoi-erbee ver e ven voish, lhig da screeuyn-scarree y chur jee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 32, 'Agh ta mish gra riu, Quoi-erbee scarrys rish e ven, agh son oyr maarderys, dy vel eh cur urree poosey y vrishey: as quoi-erbee phoosys ish ta scart, t\'eh ny vaarderagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 33, 'Myrgeddin ta shiu er chlashtyn dy row eh er ny ghra rish nyn shenn-ayryn, Cha jean oo loo-oaiagh y ghoaill, agh cooilleenee oo gys y Chiarn dty vreearaghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 34, 'Agh ta mish gra riu, Ny loo-jee er aght erbee; edyr liorish niau, son she stoyl-reeoil Yee eh:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 35, 'Ny liorish y thalloo, son shen stoyl e choshey: ny liorish Jerusalem, son shen ard-valley yn Ard-ree.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 36, 'Chamoo looys oo liorish dty chione, er-yn-oyr nagh vod oo un renaig y yannoo bane ny doo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 37, 'Agh lhig da\'n ghlare eu ve, She, she, Cha nee, cha nee: son cre-erbee ta harrish shoh, te cheet veih yn olk.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 38, 'Ta shiu er chlashtyn dy row eh er ny ghra, Sooill son sooill, as feeackyl son feeackyl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 39, 'Agh ta mish gra riu, Ny shir-jee aggair y chooilleeney: agh quoi-erbee woaillys oo er y lieckan yesh, chyndaa huggey yn lieckan elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 40, 'As my ta fer erbee dy dty eignagh ec y leigh, as goaill ersooyl dty chooat, lhig dty chloagey lesh myrgeddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 41, 'As quoi-erbee chionnys ort dy gholl un veeley marish, gow marish jees.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 42, 'Cur dasyn ta jannoo aghin hood, as veihsyn ta shirrey geeasaght void, ny chyndaa ersooyl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 43, 'Ta shiu er chlashtyn dy row eh er ny ghra, Ver oo graih da dty naboo, as feoh da dty noid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 44, 'Agh ta mish gra riu, Bee-jee dooie da nyn noidyn, bannee-jee adsyn ta gwee mollaght diu, jean-jee mie dauesyn ta cur dwoaie diu, as gow-jee padjer er nyn son ocsyn ta dy goanlyssagh jannoo tranlaase erriu:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 45, 'Dy vod shiu ve cloan nyn Ayr t\'ayns niau, son t\'eshyn cur er e ghrian girree er mie as sie, as cur fliaghey neose er y vooinjer chairagh as neu-chairagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 46, 'Son my ta shiu graihagh orroosyn ta graihagh erriuish, cre\'n leagh ta nyn gour? nagh vel eer ny publicanee jannoo yn lheid cheddin?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 47, 'My she da nyn mraaraghyn ny lomarcan ta shiu coyrt oltaghey-bea, cre smoo ta shiu dy yannoo na feallagh elley? nagh vel ny eer publicanee jannoo myr shen?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 5, 48, 'Bee-jee shiuish er-y-fa shen slane-ynrick, eer myr ta nyn Ayr t\'ayns niau slane-ynrick.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 1, 'Gow-jee tastey, nagh jean shiu nyn ghiastyllys fenish deiney, dy ve er ny akin lioroo: er-nonney cha vow shiu leagh veih\'n Ayr eu t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 2, 'Shen-y-fa tra t\'ou jannoo dty ghiastyllys, ny jean cayrn y heidey royd, myr ny crauee oalsey ayns ny margaghyn, as ayns ny straidyn, er-chee cosney moylley\'n theay. Dy firrinagh ta mee gra riu, Shen nyn leagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 3, 'Agh tra t\'ou uss jannoo dty ghiastyllys, ny lhig da fys y ve ec dty laue-chiare cre ta dty laue yesh dy yannoo:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 4, 'Dy vod dty yeirk ve follit: as nee dty Ayr ta fakin ny ta jeant dy follit, dty leagh y chur dhyt dy foshlit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 5, 'As tra vees oo goaill padjer, cha jean oo myr ny crauee-oalsey: son shynney lhieu syn shassoo seose ayns ny margaghyn, as ayns king ny straidyn dy ghoaill padjer, er-chee dy v\'er ny akin liorish deiney. Dy firrinagh ta mee gra riu, dy vel ad er gheddyn nyn leagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 6, 'Agh uss, tra t\'ou goaill padjer, immee stiagh ayns dty hiamyr; as dooney dty ghorrys, guee gys dty Ayr dy follit, as nee dty Ayr ta fakin ny ta jeant dy follit, leagh y chur dhyt dy foshlit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 7, 'As ayns nyn badjeryn, ny gow-jee lhieu harrish as harrish myr ny Ashoonee: son er-lhieu dy vow ad clashtyn liorish nyn ymmodee goan fardalagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 8, 'Ny bee-jee shiuish er-y fa shen goll roosyn: son ta fys ec nyn Ayr cre ta nyn ymmyrch, roish my jean shiu aghin huggey');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 9, 'Shen y fa er yn aght shoh gow-jee padjer: Ayr ain t\'ayns niau, Casherick dy row dty ennym.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 10, 'Dy jig dty reeriaght. Dty aigney dy row jeant er y thalloo, myr te ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 11, 'Cur dooin nyn arran jiu as gagh laa.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 12, 'As leih dooin nyn loghtyn, myr ta shin leih dauesyn ta jannoo loghtyn nyn \'oi.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 13, 'As ny leeid shin ayns miolagh, agh livrey shin veih olk: Son lhiat\'s y reeriaght, as y phooar, as y ghloyr, son dy bragh, Amen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 14, 'Son my leihys shiuish da deiney nyn loghtyn, leihee nyn Ayr flaunyssagh myrgeddin diuish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 15, 'Agh mannagh leihee shiuish da deiney nyn loghtyn, cha jean yn Ayr eu nyn loghtyn y leih diuish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 16, 'As tra vees shiu trostey, ny bee-jee groymagh myr ny crauee-oalsey, son t\'adsyn caghlaa cummey nyn eddin, er-chee deiney dy chur tastey da\'n trostey oc. Ta mee shickyrys diu, dy nee shoh (ooilley) nyn leagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 17, 'Agh uss, tra t\'ou trostey, jean dty chione y ooillaghey, as dty eddin y oonlaghey:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 18, 'Nagh bee oo ry-akin liorish deiney dy hrostey, agh liorish dty Ayr t\'ayns folliaght: as nee dty Ayr ta fakin ayns folliaght, uss y chooilleeney dy foshlit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 19, 'Ny stoyr-jee seose berchys diu hene er y thalloo, raad ta\'n lhemeen as y mergey cur-mow, as raad ta maarlee brishey stiagh as geid:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 20, 'Agh stoyr-jee seose berchys diu hene ayns niau, raad nagh vel y lhemeen ny\'n mergey cur mow, as raad nagh vel maarlee brishey stiagh as geid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 21, 'Son raad ta nyn stoyr, shen-y-raad vees y cree eu myrgeddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 22, 'Ta yn tooill soilshey yn chorp: shen-y-fa my ta\'n tooill gyn foill, bee soilshey ec ooilley dty chorp.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 23, 'Agh my ta assee er dty hooill, bee dty slane corp ayns dorraghys. My ta\'n soilshey ta aynyd\'s er-y-fa shen ny ghorraghys, nagh mooar yn dorraghys eh!');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 24, 'Cha vod dooinney erbee daa vainshter y hirveish: son edyr ver eh dwoaie da\'n derrey yeh, as graih da\'n jeh elley; ny bee eh jeidjagh da\'n derrey yeh,ny soiaghey beg jeh\'n jeh elley. Cha vod shiu Jee as Mammon y hirveish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 25, 'Er-yn-oyr shoh ta mee gra riu, Ny bee Jee ro-imneagh son nyn mea, cre ee-ys, ny cre iu-ys shiu: ny foast son nyn girp cre ver shiu miu: Nagh vel y vea ny smoo dy ve soit jeh na\'n beaghey, as y corp na\'n coamrey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 26, 'Cur-jee my-ner eeanlee yn aer: son cha vel ad cuirr ny buinn, ny chymsaghey stiagh ayns soaltyn; foast ta nyn Ayr flaunyssagh dyn meaghey ad. Nagh vel shiuish foddey share na adsyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 27, 'Quoi jiuish liorish imnea erbee oddys un chubit y chur gys e yrjid hene?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 28, 'As cre\'n-fa ta shiu imneagh son coamraghyn? Gow-jee tastey jeh lilleeyn ny magheragh kys t\'ad gaase; cha vel ad tooilleil, chamoo t\'ad sneeu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 29, 'As foast ta mee gra riu, nagh row Solomon hene ayns ooilley e ghloyr er ny choamrey myr unnane jeu shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 30, 'My ta Jee er-y-fa shen myr shoh coamrey blaa ny magheragh, ta jiu ayn, as mairagh ceaut ayns yn oghe, nagh jean eh foddey smoo shiuish y choamrey, O gheiney faase chredjuagh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 31, 'Ny bee-jee er-y-fa shen imneagh, gra, Cre nee mayd gee? ny cre nee mayd giu? ny kys yiow mayd coamrey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 32, '(Son lurg ooilley ny reddyn shoh ta ny Ashoonee imneagh) agh ec yn Ayr flaunyssagh euish ta fys, dy vel shiu feme dy chooilley nhee jeu shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 33, 'Agh shir-jee hoshiaght reeriaght Yee as e chairys, as bee shiu jeant magh lesh ooilley ny reddyn shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 6, 34, 'Ny bee-jee er-y-fa shen ayns imnea erbee son y laa mairagh, son tra hig y laa mairagh, hig e chiarail marish s\'lioar da\'n laa t\'ayn e heaghyn hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 1, 'Ny jean-jee briwnys, as cha bee shiu er nyn mriwnys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 2, 'Son lesh y vriwnys cheddin ta shiuish briwnys, bee shiu hene er nyn mriwnys: as lesh y towse ta shiuish towse, bee eh er ny howse diu reesht.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 3, 'As cre\'n-fa t\'ou cronnaghey yn brinneen t\'ayns sooill dty vraarey, agh cha vel geill ayd da\'n darrag t\'ayns dty hooill hene?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 4, 'Ny kys jir oo rish dty vraar, Lhig dou yn brinneen y ghoaill ass dty hooill, as cur-my-ner ta darrag ayns dty hooill hene?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 5, 'Er-crauee-oalsey, tilg hoshiaght yn darrag ass dty hooill hene; as eisht nee oo dy baghtal fakin dy ghoaill yn brinneen ass sooill dty vraarey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 6, 'Ny cur-jee shen ny ta casherick da ny moddee, chamoo hilgys shiu ny pearlyn eu roish muckyn, er-aggle dy stamp ad orroo fo chosh, as dy jyndaa ad reesht, as shiu y lhottey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 7, 'Yeearree-jee, as yiow shiu: shir-jee, as nee shiu feddyn: cronk-jee, as yiow shiu fosley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 8, 'Son ta dy chooilley unnane ta geearree, geddyn: as y fer ta shirrey feddyn: as dasyn ta cronkal, bee\'n dorrys er ny osley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 9, 'Ny quoi yn dooinney ny mast\' euish, ver clagh da e vac, my hirrys eh arran?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 10, 'Ny my hirrys eh eeast, der eh ard-nieu da?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 11, 'Shen-y-fa my ta fys euish ta nyn beccee, kys dy choyrt giootyn mie da nyn gloan, cre woad smoo nee\'n Ayr eu t\'ayns niau nheeghyn mie y choyrt dauesyn ta jannoo aghin huggey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 12, 'Shen-y-fa dy chooilley nhee cre erbee bailliuish deiney dy yannoo riuish, jean-jee shiuish y lheid cheddin roosyn: son shoh yn leigh as ny phadeyryn');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 13, 'Immee-jee stiagh er y ghiat coon; son lhean ta\'n giat, as feayn ta\'n raad ta leeideil gys toyrt-mow, as shimmey ta goll er:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 14, 'Er-yn-oyr dy nee chion ta\'n giat, as coon ta\'n raad ta leeideil gys bea, as s\'tiark ad ta dy haaghey eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 15, 'Bee-jee er nyn dwoaie jeh phadeyryn foalsey, ta cheet hiu ayns coamrey keyrragh, agh cheu-sthie t\'ad nyn moddee-oaldey jollyssagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 16, 'Ver shiu enney orroo liorish nyn messyn. Vel mess y villey-feeyney er ny heiy jeh drineyn, ny mess y villey-figgagh jeh onnaneyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 17, 'Myr shen ta dagh billey mie tilgey mess mie: agh ta drogh-villey tilgey drogh vess.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 18, 'Cha vod billey mie drogh-vess y chur magh: ny drogh-villey mess mie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 19, 'Bee dy chooilley villey nagh vel gymmyrkey magh mess mie, giarit sheese, as ceaut ayns yn aile.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 20, 'Shen-y-fa liorish nyn messyn ver shiu enney orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 21, 'Cha nee dy chooilley unnane jir rhym\'s, Hiarn, Hiarn, hed stiagh er reeriaght niau: agh eshyn ta jannoo aigney my Ayrey t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 22, 'Jir ymmodee rhym\'s \'sy laa shen, Hiarn, Hiarn, nagh vel shin er n\'yannoo phadeyrys ayns dt\'ennym\'s? as ayns dt\'ennym er chastey drogh-spyrrydyn? as ayns dt\'ennym er n\'yannoo ymmodee obbraghyn yindyssagh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 23, 'As eisht neem\'s fockley-magh orroo, Cha row aym rieau ainjys erbee erriu: reue-jee voym, O shiuish ghrogh-yantee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 24, 'Quoi-erbee er-y-fa shen ta clashtyn ad shoh my ghoan\'s, as jannoo ymmyd mie jeu soylee-ym eh gys dooinney creeney hrog e hie er creg:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 25, 'As haink y fliaghey neose, as dhatt ny thooillaghyn, as heid ny geayghyn, as cheau ad er y thie shen: as cha huitt eh, son dy row yn undin echey er creg.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 26, 'As dy chooilley unnane ta clashtyn ad shoh my ghoan\'s, as nagh vel jannoo ymmyd mie jeu, bee eh er ny hoylaghey gys dooinney ommijagh, hrog e hie er y gheinnagh:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 27, 'As huitt y fliaghey, as dhatt ny thooillaghyn, as heid ny geayghyn, as cheau ad er y thie shen: as huitt eh, as s\'mooar va e lhieggey!');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 28, 'As haink eh gy-kione, erreish da Yeesey v\'er loayrt ny goan shoh, dy row yn pobble ayns ard-yindys jeh\'n ynsaghey echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 7, 29, 'Son dynsee eh ad myr fer ayns slane pooar, as cha nee myr ny Scrudeyryn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 1, 'Tra v\'eh er jeet neose jeh\'n clieau, deiyr earrooyn mooarey dy leih er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 2, 'As cur-my-ner haink lourane, as hug eh ooashley da, gra, Hiarn, my she dt\'aigney eh, foddee oo mish y yannoo glen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 3, 'As heeyn Yeesey magh e laue, as venn eh rish, gra, My aigney\'s eh, bee er dty ghlenney. As chelleeragh va\'n louraanys echey er ny ghlenney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 4, 'As dooyrt Yeesey rish, Jeeagh nagh n\'insh oo shoh da dooinney erbee, agh immee royd, as jeeagh oo hene da\'n taggyrt, as cheb yn oural doardee Moses son feanish daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 5, 'As tra va Yeesey er n\'gholl stiagh ayns Capernaum, haink centurion huggey, guee er,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 6, 'As gra, Hiarn, ta my er-mooinjerey ny lhie ching ec y thie jeh\'n chingys-craaee, ayns stayd feer treih.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 7, 'As dooyrt Yeesey rish, Hig-yms, as nee\'m eh y lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 8, 'As dreggyr yn centurion, gra, Hiarn, cha vel mee feeu oo dy heet stiagh fo my chlea: agh ynrycan loayr y fockle, as bee my harvaant er ny lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 9, 'Son ta mish mee hene my ghooinney ayns pooar, as sidooryn aym foym: as ta mee gra rish y dooinney shoh, Immee, as t\'eh goll: as rish fer elley, Tar, as t\'eh cheet: as rish my harvaant, Jean shoh, as t\'eh dy yannoo eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 10, 'Tra cheayll Yeesey shoh, ghow eh yindys, as dooyrt eh roosyn va geiyrt er, Dy firrinagh ta mee gra riu, Lheid y credjue lajer shoh, cha vel mee er gheddyn ayns Israel hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 11, 'As ta mee gra riu, dy jig ymmodee veih yn niar as veih yn neear, as dy soie ad sheese marish Abraham, as Isaac, as Jacob, ayns reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 12, 'Agh bee cloan y reeriaght er nyn yiooldey magh gys y dorraghys sodjey-mooie: ayns shen vees keayney as snaggeraght feeacklyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 13, 'As dooyrt Yeesey rish y centurion, Immee royd, as \'naght myr t\'ou er chredjal, myr shen dy jig oo jeh. As va e er-mooinjerey er ny lheihys ayns yn oor cheddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 14, 'As tra va Yeesey er jeet stiagh ayns thie Pheddyr, honnick eh moir e ven ny lhie, as ching ayns y chiassaghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 15, 'As venn eh rish y laue eck, as daag yn chiassaghey ee: as ren ee girree, as shirveish orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 16, 'Tra va\'n fastyr er jeet, hug ad lhien huggey ymmodee va drogh-spyrrydyn ayndoo: as deiyr eh magh ny spyrrydyn lesh fockle, as laanee eh ooilley ny va ching.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 17, 'Myr shoh va cooilleenit shen ny loayr Esaias y phadeyr, gra, Ghow eh-hene er ny aslayntyn ainyn, as dymmyrk eh nyn ghoghanyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 18, 'Nish tra honnick Yeesey earrooyn mooarey dy leih mygeayrt y mysh, hug eh sarey dy gholl gys y cheu elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 19, 'As haink scrudeyr dy row huggey, as dooyrt eh rish, Vainshter, eiyr-yms ort raad erbee dy jed oo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 20, 'As dooyrt Yeesey rish, Ta tuill ec ny shynnee, as idd ec eeanlee yn aer, agh cha vel ec mac y dooinney wheesh boayl aaght son e chione.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 21, 'As dooyrt fer elley jeh e ynseydee rish, Hiarn, lhig dou hoshiaght goll thie dy oanluckey my ayr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 22, 'Agh dooyrt Yeesey rish, Eiyr orrym\'s, as lhig da ny merriu nyn merriu y oanluckey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 23, 'As tra v\'eh er ghoaill lhuingys, hie e ynseydee marish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 24, 'As cur-my-ner hrog sterrym mooar ayns yn aarkey, myr shen dy row ny tonnyn brishey harrish y lhong: agh v\'eshyn ny chadley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 25, 'As haink e ynseydee huggey, as ghooisht ad eh, gra, Hiarn, saue shin: bee mayd caillit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 26, 'As dooyrt eh roo, Cre\'n-fa ta shiu agglagh, shiuish dy chredjue moal? Eisht dirree eh, as hug eh yn gheay, as yn aarkey fo-harey as va kiuney vooar ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 27, 'Agh ghow ny deiney yindys, gra, Cre\'n dooinney eh shoh, dy vel ny eer geayghyn as y faarkey ayns biallys da!');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 28, 'As tra v\'eh er jeet gys y cheu elley, gys cheer ny Gergesenee haink daa ghooinney va drogh-spyrrydyn ayndoo magh ny whail, veih mastey ny hoiaghyn, as cha keoi shen v\'ad, nagh by-lhoys da dooinney erbee goaill yn raad shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 29, 'As cur-my-ner deie ad, gra, Cre\'n eie t\'ayd orrin, Yeesey Vac Yee? vel oo er jeet dy nyn dorchaghey roish y traa?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 30, 'As tammylt voue va beiyhaghey griagh mooar dy vuckyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 31, 'As ghuee ny drogh-spyrrydyn er, gra, My eiyrys oo magh shin, lhig dooin goll stiagh ayns ny muckyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 32, 'As dooyrt eh roo, Gow-jee reue. As tra v\'ad er jeet ass ny deiney, hie ad stiagh ayns y ghriagh dy vuckyn: as cur-my-ner roie yn slane griagh gour nyn mullee lesh yn eaynee gys y cheayn, as v\'ad baiht ayns ny ushtaghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 33, 'As roie ny bochillyn roue, as haink ad gys yn ard-valley, as dinsh ad dy chooilley nhee: as mychione ny deiney va seaghnit lesh ny drogh-spyrrydyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 8, 34, 'As cur-my-ner, haink y slane ard-valley magh quail Yeesey, as tra honnick ad eh, ghuee ad er, eh dy gholl roish ass ny ardjyn oc.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 1, 'As ghow eh lhuingys, as hioill eh harrish, as haink eh gys e ard-valley hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 2, 'As cur-my-ner, hug ad lhieu huggey dooinney doghanit lesh y chingys craaee, ny lhie er lhiabbee: as Yeesey goaill tastey jeh\'n chredjue oc, dooyrt eh rish y varter, Vac, bee dy yien mie, ta dty pheccaghyn er ny leih dhyt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 3, 'Er shoh, dooyrt shiartanse jeh ny scrudeyryn roo hene, T\'eh shoh loayrt goan mollaghtagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 4, 'As Yeesey toiggal ny smooinaghtyn oc, dooyrt, Cre\'n-fa ta drogh smooinaghtyn troggal ayns ny creeaghyn eu?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 5, 'Son cre sassey dy ghra, Ta dty pheccaghyn er ny leih dhyt? ny dy ghra, Irree seose as shooill?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 6, 'Agh dy vod fys y ve eu, dy vel pooar ec Mac y dooinney er y thalloo dy leih peccaghyn: (eisht dooyrt eh rish y varter) Irree, trog lhiat dty lhiabbee, as immee royd gys dty hie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 7, 'As dirree eh seose as jimmee eh gys e hie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 8, 'Agh tra honnick y pobble shoh, ghow ad yindys, as hug ad moylley da Jee, v\'er choyrt lheid y phooar da deiney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 9, 'As tra yn Yeesey er n\'gholl veih shen, honnick eh dooinney va enmyssit Mian, ny hoie ec boayrd y cheesh: as dooyrt eh rish, Eiyr orrym\'s. As dirree eh seose, as deiyr eh er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 10, 'As haink eh gy-kione, myr va Yeesey ny hoie ec bee ayns y thie, cur-my-ner haink ymmodee publicanee as peccee, as hoie ad sheese marishyn as marish e ynseydee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 11, 'Tra honnick ny Phariseeyn shoh, dooyrt ad rish e ynseydee, Cre\'n-fa ta\'n mainshter eu gee marish publicanee as peccee?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 12, 'Agh cheayll Yeesey ad, as dooyrt eh roo, Cha vel feme ocsyn ta slane er yn er-lhee, agh ec sleih chingey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 13, 'Agh immee-jee shiuish, as ynsee-jee cre ta dy ve toiggit liorish y raa shoh, S\'bare lhiam myghin na oural: son cha daink mish dy eamagh er y vooinjer chairagh, agh er peccee gys arrys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 14, 'Eisht haink huggey ynseydee Ean, as dooyrt ad, Cre\'n-fa ta shinyn as ny Phariseeyn trostey dy mennick, agh cha vel y vooinjer ayd\'s trostey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 15, 'As dooyrt Yeesey roo, Vod caarjyn y dooinney-poosee dobberan, choud as ta dooinney yn phoosee maroo? agh hig ny laghyn, tra vees dooinney yn phoosee er ny ghoaill ersooyl voue, as shen y traa nee ad trostey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 16, 'Cha vel dooinney erbee cur peesh dy eaddagh noa er shenn gharmad: son ta\'n pheesh goaill e laane ass y gharmad, as ta\'n assee wheesh shen smessey,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 17, 'Chamoo ta sleih coyrt feeyn noa ayns shenn voteilyn: er-nonney ta ny boteilyn scoltey, as ta\'n feeyn er ny gheayrtey, as ta ny boteilyn dy choayl orroo; agh t\'ad cur feeyn noa ayns boteilyn noa, as t\'ad ny neesht sauchey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 18, 'Choud as v\'eh loayrt ny goan shoh roo, cur-my-ner haink fer-reill, as hug eh ooashley da, gra, Ta m\'inneen eer nish paartail: agh tar, as cur dty laue urree, as bee ee bio.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 19, 'As hrog Yeesey, as deiyr eh er, as myr shen ren e ynseydee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 20, '(As cur-my-ner haink ben cheu-e-chooylloo, va doghanit lesh roie-folley rish daa vlein jeig, as venn ee rish oirr e gharmad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 21, 'Son dooyrt ee r\'ee hene, My oddym agh bentyn rish e gharmad bee-ym er my lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 22, 'Agh hyndaa Yeesey mygeayrt, as tra honnick eh ee, dooyrt eh, Inneen bee dy yien mie; ta dty chredjue er dty laanaghey. As va\'n ven er ny lheihys veih yn oor shen magh.)');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 23, 'As tra va Yeesey er jeet stiagh ayns thie yn er-reill, as tra honnick eh ny bardoonee, as y cheshaght ooilley \'syn un chiaull.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 24, 'Dooyrt eh roo, Scugh-jee, son cha vel y ven-aeg marroo, agh ny cadley. As hie ad son craidey mysh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 25, 'As tra va\'n sleih er skeayley, hie eh stiagh, as ghow eh ee er laue, as dirree yn ven-aeg.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 26, 'As hie goo magh jeh shoh trooid ooilley yn cheer.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 27, 'As tra va Yeesey er n\'immeeaght veih shen, deiyr daa ghooinney doal er gyllagh as gra, Jean myghin orrin, Vac');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 28, 'As tra v\'eh er jeet stiagh ayns y thie, haink ny deiney doal huggey: as dooyrt Yeesey roo, Vel shiu credjal dy voddym shoh y yannoo? Dooyrt adsyn rish, Ta Hiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 29, 'Eisht venn eh rish ny sooillyn oc, gra Cordail rish nyn gredjue dy row nyn aghin eu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 30, 'As va ny sooillyn oc er nyn vosley, as hug Yeesey currym gyere orroo, gra, Jeeagh Jee nagh vow dooinney erbee fys er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 31, 'Agh tra v\'adsyn er n\'gholl roue, hug ad goo jeh magh trooid ooilley yn cheer shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 32, 'Erreish daue shoh v\'er n\'gholl ersooyl, cur-my-ner, hug ad lhieu huggey dooinney balloo va drogh-spyrryd ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 33, 'As tra va\'n drogh-spyrryd er ny chastey, ren y balloo loayrt: as ghow yn pobble yindys, gra, Cha row rieau lheid shoh er ny akin ayns Israel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 34, 'Agh dooyrt ny Phariseeyn, Liorish yn ard ghrogh-spyrryd t\'eshyn castey drogh-spyrrydyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 35, 'As hie Yeesey mygeayrt ooilley ny ard-valjyn as ny baljyn-cheerey oc, gynsaghey ayns ny kialteenyn oc, as preacheil sushtal yn reeriaght, as lheihys dy chooilley hingys, as dy chooilley ghoghan mastey\'n pobble.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 36, 'Agh tra honnick eh yn chaglym mooar dy leih, v\'eh er ny veiyghey lesh chymmey orroo, er-yn-oyr dy row ad tooillit, as er nyn skeayley noon as noal, myr kirree fegooish bochilley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 37, 'Eisht dooyrt eh rish e ynseydee, Ta\'n fouyr dy jarroo palchey, agh s\'coan ta ny beayneeyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 9, 38, 'Guee-jee shiuish, er-y-fa shen, er Chiarn y fouyr, eh dy chur magh labreeyn gys y fouyr echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 1, 'As tra v\'eh er n-eamagh er e ghaa ostyl jeig huggey, hug eh daue pooar harrish spyrrydyn neu-ghlen dy chastey ad, as dy lheihys dy chooilley vonney dy hingys, as dy chooilley ghoghan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 2, 'As shoh va enmyn yn daa ostyl yeig; Yn chied-er, Simon, ta enmyssit Peddyr, as Andreays e vraar, Jamys mac Zebedee, as Ean y braar echeysyn');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 3, 'Philip as Parlane, Thomase, as Mian yn publican, Jamys mac Alpheus, as Lebbeus va slennooit Thaddeus.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 4, 'Simon yn Canaanite, as Yuaase Iscariot, ren myrgeddin eh y vrah.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 5, 'Yn ghaa-yeig shoh hug Yeesey magh, as doardee eh daue, gra, Ny immee-jee raad ny Hashoonee, ny gys ard-valjyn ny Samaritanee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 6, 'Agh immee-jee hoshiaght gys kirree cailjey thie Israel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 7, 'As myr vees shiu goll, jean-jee preacheil, gra, Ta reeriaght niau er-gerrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 8, 'Slaanee-jee sleih chingey, glen-jee ny louranee, jean-jee ny merriu y aa-vioghey, as drogh-spyrrydyn y chastey: nastee ta shiu er gheddyn, as dy nastee cur-jee veue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 9, 'Ny kiare-jee son airh, ny argid, ny prash y ve eu ayns nyn sporranyn:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 10, 'Ny spagey son y raad, ny daa chooat, ny braagyn, ny lorg: (son ta\'n obbree toilliu e veaghey).');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 11, 'As ard-valley ny balley erbee dy jed shiu stiagh ayn, Jean-jee briaght quoi ayn ta feeu, as marishyn gow-jee aaght derrey hed shiu reue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 12, 'As tra hed shiu stiagh ayns thie, bannee-jee daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 13, 'As my vees y thie feeu, lhig da\'n shee eu cheet er: agh mannagh bee eh feeu, lhig da\'n shee eu chyndaa hiu hene reesht.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 14, 'As quoi-erbee nagh der oltaghey bea diu, as nash der geill da ny goan eu: tra aagys shiu yn thie ny\'n ard-valley shen, crie-jee veue joan nyn goshey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 15, 'Dy firrinagh ta mee gra riu, Dy bee eh ny sassey da cheer Sodom as Gomorrah, ec laa ny briwnys, na da\'n ard-valley shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 16, 'Cur-my-ner ta mish dy choyrt shiu magh myr kirree mastey moddee oaldey: Bee-jee er-y-fa shen tastagh myr ard-nieughyn, as oney myr calmaneyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 17, 'Agh bee-jee er nyn dwoaie roish deiney, son livrey-ee ad shiu seose gys ny coonceilyn, as scuitchee ad shiu ayns nyn quaiylyn oc.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 18, 'As bee shiu er nyn goyrt fenish kiannoortyn as reeaghyn er y choontey aym\'s, myr shoh gymmyrkey feanish dauesyn, as da ny Ashoonee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 19, 'Agh tra ver ad stiagh shiu, ny bee-jee imneagh cre\'n aght, ny cre nee shiu gra, son bee eh er ny choyrt diu ayns yn oor cheddin cre nee shiu y ghra.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 20, 'Son cha nee shiuish ta loayrt, agh spyrryd yn Ayr eu ta loayrt ayndiu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 21, 'As livreyee braar seose e vraar gys baase, as yn ayr e lhiannoo: as nee cloan girree magh noi nyn ayr as nyn moir, as bee ad feanishyn baaish orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 22, 'As ver yn ymmodee feoh diu er coontey yn ennym aym\'s: agh eshyn nee shassoo magh gys y jerrey, bee eh er ny hauail.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 23, 'Agh tra nee ad tranlaase erriu ayns un ard-valley, cosne-jee reue gys ard-valley elley: son ta mee shickyrys diu, nagh bee shiu er n\'gholl harrish ard-valjyn Israel derrey vees Mac y dooinney er jeet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 24, 'Cha vel y scoillar erskyn e vainshter ny\'n charvaant erskyn e hiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 25, 'S\'lioar da\'n scoillar dy ve myr e vainshter, as y charvaant myr e hiarn: my t\'ad er cheau Beelzebub er mainshter y thie, cre woad smoo nee ad e vooinjer y oltooaney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 26, 'Ny gow-jee er-y-fa shen aggle roue: son cha vel nhee erbee follit nagh jir gys soilshey: ny nhee erbee keillit, nagh jig er-ash.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 27, 'Shen ta mish dy insh diu ayns folliaght fockle-jee shiuish magh eh dy foshlit: as shen ta shiu er chlashtyn myr hannish voym\'s, jean-jee y phreacheil er mullagh ny dhieyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 28, 'As ny bee aggle erriu rouesyn varrys y corp, agh nagh jarg er yn annym y varroo: agh bee-jee ayns aggle smoo roishyn oddys annym as callin neesht y stroie ayns niurin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 29, 'Nagh vel daa sparroo er nyn greck son farling? as cha duitt unnane oc marroo er y thalloo fegooish oardagh yn Ayr eu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 30, 'Agh ta eer renaigyn nyn ghing ooilley er nyn earroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 31, 'Ny bee-jee shiuish er-y-fa shen ayns aggle, ta ny smoo dy ve soit jiuish na jeh ymmodee sperriu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 32, 'Quoi-erbee er-y-fa shen ghoys rhym\'s kiongoyrt rish deiney, goym\'s rishyn myrgeddin kiongoyrt rish my Ayr t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 33, 'Agh quoie-erbee obbys mish kiongoyrt rish deiney, eshyn neem\'s myrgeddin y obbal kiongoyrt rish my Ayr t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 34, 'Ny smooinee-jee dy daink mish dy chur lhiam shee er y thalloo: cha daink mee dy chur lhiam shee, agh cliwe.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 35, 'Son ta mish er jeet dy scarrey dooinney veih e ayr, as yn inneen veih e moir, as y ven-chleuin veih e moir-\'sy-leigh');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 36, 'As noidyn dooinney vees adsyn jeh\'n lught-thie echey hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 37, 'Eshyn ta ny s\'graihee er ayr ny moir na orrym\'s, cha vel eh feeu jee\'m: as eshyn ta ny s\'graihee er mac ny inneen na orrym\'s cha vel eh feeu jee\'m.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 38, 'As eshyn nagh jean e chrosh y ymmyrkey, as geiyrt orrym\'s, cha vel eh feeu jee\'m.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 39, 'Eshyn ta aggindagh e vioys y hauail, caillee eh eh: agh eshyn chaillys e vioys er my ghraih\'s, nee eh eh y hauail.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 40, 'Eshyn ta soiaghey jiuish, t\'eh soiaghey jeem\'s: as eshyn ta soiaghey jeem\'s, t\'eh soiaghey jehsyn t\'er my choyrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 41, 'Eshyn ta cur oltaghey-bea da phadeyr ayns ennym phadeyr, yiow eh leah phadeyr as eshyn ta cur oltaghey-bea da dooinney cairagh ayns ennym dooinney cairagh, yiow eh leagh dooinney cairagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 10, 42, 'As quoi-erbee ver agh cappan dy ushtey feayr da unnane jeh\'n vooinjer veggey shoh dy iu, son dy vel eh credjal aynym\'s, dy firrinagh ta mee gra riu, nagh jean eh er aght erbee e leagh y choayl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 1, 'As haink eh gy-kione, erreish da Yeesey v\'er choyrt ny curmyn shoh da e ghaa ostyl jeig dy jagh eh veih shen dy ynsaghey, as dy phreacheil ayns ny ard-valjyn mygeayrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 2, 'Nish tra va Ean er chlashtyn ayns y phryssoon jeh obbraghyn Chreest, hug eh jees jeh e ynseydee hene er chaghteraght huggey,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 3, 'Dy ghra rish, Nee uss eh va dy heet ny vel shin dy yeeaghyn son fer elley?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 4, 'Dreggyr Yeesey as dooyrt eh roo, Immee-jee, as soilshee-jee da Ean ny reddyn ta shiu dy chlashtyn as dy akin:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 5, 'Ta ny doail geddyn nyn soilshey, as ny croobee shooyll, ny louraanee er nyn ghlenney, ny beuyr clashtyn, ny merriu er nyn mioghey, as yn sushtal er ny phreacheil da ny boghtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 6, 'As bannit ta eshyn nagh jean beg y hoiaghey jeem\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 7, 'As myr v\'ad goll roue, ren Yeesey toshiaght dy ghra rish y pobble mychione Ean, Cre hie shiu magh gys yn aasagh dy akin? Nee cuirtlagh criht lesh y gheay?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 8, 'Agh cre hie shiu magh dy akin? Dooinney coamrit ayns garmad moyrnagh? Cur-my-ner, t\'adsyn ta ceau coamrey moyrnagh ayns cooyrtyn reeoil.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 9, 'Agh cre hie shiu magh dy akin? Nee phadeyr? dy jarroo ta mee gra riu, as fer syrjey na phadeyr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 10, 'Son shoh eh, my-e-chione te scruit, Cur-my-ner ta mee cur my haghter magh royd, dy chiartaghey\'n raad kiongoyrt rhyt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 11, 'Dy firrinagh ta mee gra riu, ny mast\' ocsyn t\'er ve ruggit jeh mraane, cha vel fer syrjey na Ean Bashtey er droggal: ny-yeih ta\'n fer sloo t\'ayns reeriaght niau ny syrjey na eshyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 12, 'As er-dy laghyn Ean Bashtey derrey nish, ta sleih chionney stiagh gys reeriaght niau, as t\'adsyn ta cheet lesh jeeanid cosney stiagh ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 13, 'Son ren ooilley ny phadeyryn as y leigh phadeyrys derrey Ean.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 14, 'As my ta shiu booiagh goaill-rish, shoh Elias va ry-hoi cheet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 15, 'Eshyn ta cleayshyn echey dy chlashtyn lhig da clashtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 16, 'Agh cre gys nee\'m yn cheeloghe shoh y hoylaghey? T\'ad goll-rish cloan ta nyn soie ayns ny margaghyn, as geamagh da ny sheshaghyn oc.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 17, 'As gra, Ta shin er n\'yannoo bingys diu, as cha vel shiu er ghaunsin: ta shin er hroggal bardoon diu, as cha vel shiu er ghobberan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 18, 'Son cha daink Ean gee ny giu, as t\'ad gra, Ta drogh-spyrryd ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 19, 'Haink Mac yn dooinney gee as giu, as t\'ad gra, Cur-my-ner dooinney jollyssagh, as iuder feeyney, carrey dy publicanee as dy pheccee: agh ta creenaght er ny heyrey liorish e cloan hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 20, 'Eisht ren eh toshiaght dy phlaiynt er ny ard-valjyn, ayndoo va\'n chooid smoo jeh e obbraghyn yindyssagh er nyn yannoo, er-yn-oyr nagh ghow ad arrys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 21, 'Smerg dhyt\'s Chorazin, smerg dhyt\'s Vethsaida: son dy beagh ny obbraghyn yindyssagh er ny ve jeant ayns Tyre as Sidon t\'er ny ve jeant ayndiuish, veagh ad er ghoaill arrys foddey er-dy-henney ayns aanrit-sack as leoie');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 22, 'Agh ta mee gra riu, Dy bee kerraghey s\'eddrym er ny choyrt er Tyre as Sidon ec laa ny briwnys, na vees er ny choyrt erriuish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 23, 'As uss, Chapernaum, ta dty ooashley roshtyn gys niau, bee oo er dty hilgey sheese gys niurin: son dy beagh ny obbraghyn yindyssagh er ve jeant ayns Sodom, t\'er ve jeant aynyd\'s, veagh eh er ve er-mayrn gys y laa t\'ayn jiu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 24, 'Agh ta mee gra riu, dy bee kerraghey sassey er ny choyrt er thalloo Sodom ec laa ny briwnys, na vees ort\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 25, 'Ec y traa shen dreggyr Yeesey as dooyrt eh, Ta mee cur booise dhyt, O Ayr, Hiarn niau as thalloo, er-yn-oyr dy vel oo er cheiltyn ny reddyn shoh vouesyn ta creeney as tushtagh, as dy vel oo er hoilshaghey ad da oikanyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 26, 'Shen dy jarroo myr te, Ayr, son shen myr ve mie ayns dty hilley\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 27, 'Ta dy chooilley nhee er ny livrey dooys liorish my Ayr: as cha nhione da dooinney erbee yn Mac, agh yn Ayr: chamoo shione da dooinney erbee yn Ayr, agh y Mac, as eshyn da s\'gooidsave lesh yn Mac eh y hoilshaghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 28, 'Tar-jee hym\'s ooilley shiuish ta deinagh as trome laadit, as neem\'s shiu y ooraghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 29, 'Gow-jee my whing erriu, as ynsee-jee voym\'s, son ta mee meen as imlee ayns cree: as yiow shiu fea da nyn amneenyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 11, 30, 'Son ta my whing aashagh, as my errey eddrym.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 1, 'Ec y traa shen hie Yeesey trooid magher arroo-er y doonaght, as va e ostyllyn accryssagh, as ghow ad toshiaght dy phluckey ny jeeassyn arroo, as dy ee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 2, 'Agh tra honnick ny Phariseeyn ad, dooyrt ad rish, Cur-my-ner ta dty vooinjer\'s jannoo shen nagh vel lowal dy ve jeant er y doonaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 3, 'Agh dooyrt eshyn roo, Nagh vel shiuish er lhaih cre ren David, tra v\'eh hene as e heshaght accryssagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 4, 'Kys hie eh stiagh ayns thie Yee, as d\'ee eh yn arran casherick, nagh row lowit dasyn dy ee, agh da ny saggyrtyn ny-lomarcan?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 5, 'Er-nonney, nagh vel shiu er lhaih ayns y leigh, kys er laghyn y doonaght ta ny saggyrtyn ayns y chiamble brishey yn doonaght, as foast cha vel peccah er ny choyrt ass nyn lieh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 6, 'Agh ta mish gra riuish, dy vel ayns shoh fer syrjey na\'n chiamble.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 7, 'Agh dy beagh fys er ve euish, cre ta er ny hoiggal liorish y raa shoh, Share lhiam myghin na oural, cha beagh shiu er gheyrey yn vooinjer neu-chyndagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 8, 'Son ta Mac y dooinney ny Hiarn er y doonaght hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 9, 'As tra v\'eh er n\'gholl veih shen, hie eh stiagh ayns nyn synagogue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 10, 'As cur-my-ner, va dooinney ayns shen va\'n laue echey er shyrgaghey: as, dy vod dagh oyr plaiynt y ve oc noi Yeesey, denee ad jeh, gra, Vel eh lowal dy lheihys er laghyn y doonaght?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 11, 'As dooyrt eh roo, Quoi yn dooinney ny mast\' eu, vees un cheyrrey echey, as my huittys ee ayns jeeg er y doonaght, nagh daare eh greme urree, as nagh drog eh ass ee?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 12, 'Nagh vel dooinney eisht foddey share na keyrrey? Shen-y-fa te lowal dy yannoo mie er y doonaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 13, 'Eisht dooyrt eh rish y dooinney, Sheeyn magh dty laue: as heeyn eh magh ee; as va\'n laue echey er ny lheihys myr y laue elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 14, 'Eisht hie ny Phariseeyn magh, as hug ad nyn goyrle dy-cheilley n\'oi, kys oddagh ad eh y stroie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 15, 'Agh tra va fys ec Yeesey er, jimmee eh veih shen: as deiyr earrooyn mooarey dy leih er, as ren eh ad ooilley y lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 16, 'As hug eh currym daue, gyn ad dy vrah eh:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 17, 'As shoh myr va cooilleenit shen ny loayr Esaias y phadeyr, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 18, 'Cur-my-ner, my hirveishagh hene ta mee er reih, my er-graihagh hene, eer taitnys my anmey: ver-yms yn spyrryd aym\'s ersyn, as soilshee eh briwnys da ny Ashoonee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 19, 'Cha bee eh streeuagh ny anveaagh, chamoo chluinnys fer erbee e choraa ayns ny straidyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 20, 'Cuirtlagh vroojit cha jean eh y vrishey, as y bite giare-cheaut cha der eh ass, derrey ver eh magh briwnys ayns barriaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 21, 'As ayns yn ennym echeysyn nee ny Ashoonee treishteil.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 22, 'Eisht hug ad lhieu huggey dooinney seaghoit lesh drogh-spyrryd, doal as balloo: as ren eh eh y lheihys, myr shen dy ren eshyn va doal as balloo chammah loayrt as fakin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 23, 'As ghow ooilley yn pobble yindys, as dooyrt ad, Nagh nee shoh mac Ghavid?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 24, 'Agh tra cheayll ny Phariseeyn shoh, dooyrt ad, Cha vel eh shoh castey drogh spyrrydyn, agh liorish Beelzebub prince ny drogh-spyrrydyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 25, 'As Yeesey toiggal ny smooinaghtyn oc, dooyrt roo, Ta dy chooilley reeriaght ta girree magh n\'oi hene goll naardey: as ard-valley ny thie erbee ta girree-magh fo-my-cheilley, cha vod ad shassoo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 26, 'As my ta Satan castey Satan, t\'eh girree-magh n\'oi hene: kys eisht oddys y reeriaght echey shassoo?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 27, 'As my ta mish liorish Beelzebub castey drogh-spyrrydyn, quoi liorish ta nyn mooinjer hene dy chastey ad? adsyn er-y-fa shen vees ny briwnyn eu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 28, 'Agh my ta mish liorish spyrryd Yee castey drogh-spyrrydyn, eisht ta reeriaght Yee er jeet hiuish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 29, 'Er-nonney, kys oddys fer goll stiagh ayns thie yn treanagh, as e chooid y ghoaill er-niart, mannagh geulee eh hoshiaght yn treanagh, as eisht nee eh e hie y roostey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 30, 'Eshyn nagh vel lhiam, t\'eh m\'oi: as eshyn nagh vel chymsaghey marym, t\'eh skeayley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 31, 'Shen-y-fa ta mee gra riu, Bee dy chooilley pheccah as raa mollaghtagh er ny leih da deiney: agh goan mollaghtagh noi yn Spyrryd Noo cha bee er nyn leih da deiney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 32, 'As quoi-erbee loayrys fockle noi Mac y dooinney, bee eh er ny leih da: agh quoi erbee loayrys noi yn Spyrryd Noo, cha bee eh er ny leih da, edyr \'sy theihll shoh, ny \'sy theihll ta ry-heet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 33, 'Edyr jean-jee yn billey mie, as e vess mie; er-nonney jean-jee yn billey olk, as e vess olk: son liorish e vess, ta enney er ny choyrt er y villey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 34, 'O shiuish heeloghe dy ard-nieughyn, kys oddys shiuish ta olk shiu hene, reddyn mie y loayrt? son ass laanid y chree ta\'n beeal loayrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 35, 'Ta dooinney mie ass stoyr mie yn chree echey, cur magh reddyn mie: as drogh ghooinney ass y drogh-stoyr cur magh drogh reddyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 36, 'Agh ta mee gra riu, Dy chooilley ghrogh-ockle nee deiney y loayrt, dy der ad coontey er y hon ec laa ny briwnys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 37, 'Son liorish dty ghoan bee oo er dty heyrey, as liorish dty ghoan bee oo er dty gheyrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 38, 'Eisht dreggyr shiartanse jeh ny scrudeyryn as jeh ny Phariseeyn, gra, Vainshter, baillhien cowrey y akin void.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 39, 'Agh dreggyr eshyn, as dooyrt eh roo, Ta drogh-heeloghe as neu-ghooghyssagh shirrey cowrey, agh cha bee cowrey erbee er ny chur daue, agh cowrey yn adeyr Jonas.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 40, 'Son myr va Jonas three laghyn as three oieghyn ayns bolg y whale: myr shen bee Mac y dooinney three laghyn as three oieghyn ayns cree yn thallooin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 41, 'Nee deiney Nineveh girree seose ayns briwnys, as y cheeloghe shoh y gheyrey, er-yn-oyr dy ghow ad arrys ec preacheil Yonas, as cur-my-ner, ta fer syrjey na Jonas ayns shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 42, 'Nee ben-rein y jiass girree seose ayns briwnys noi yn cheeloghe shoh, as ad y gheyrey: son haink ish veih ardjyn sodjey magh y thallooin, dy chlashtyn creenaght Solomon, as cur-my-ner ta fer s\'ooasle na Solomon ayns shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 43, 'Tra ta\'n spyrryd neu-ghlen er n\'gholl ass dooinney, t\'eh shooyll trooid faasaghyn fadane, chee aash, agh ayns fardail.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 44, 'Eisht t\'eh gra, Chyndaa-ym gys my hie, ass haink mee; as tra t\'eh cheet, t\'eh dy gheddyn eh follym, sceabit, as soit magh dy stooamey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 45, 'Eisht t\'eh goll, as cur lesh marish shiaght spyrrydyn elley ta ny smessey na eh hene, as t\'ad goll shagh as cummal ayns shen: as ta stayd yerrinagh yn dooinney shen ny s\'doogh na\'n toshiaght. Eer myr shoh hig eh dy ve er y cheeloghe vee chrauee shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 46, 'Choud as v\'eh foast loayrt rish y pobble, cur-my-ner va e voir as e vraaraghyn nyn shassoo mooie, shirrey loayrt rish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 47, 'Eisht dooyrt fer rish, Cur-my-ner, ta dty voir as dty vraaraghyn nyn shassoo mooie, shirrey loayrt rhyt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 48, 'Agh dreggyr eshyn yn fer dinsh shoh da, gra, Quoi my voir? as quoi my vraaraghyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 49, 'As heeyn eh magh e laue lhieusyn va sheer geiyrt er, as dooyrt eh, Cur-my-ner my voir, as my vraaraghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 12, 50, 'Son quoi-erbee nee aigney my Ayrey t\'ayns niau, eh shen my vraar, as my huyr as my voir.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 1, 'Yn laa cheddin hie Yeesey magh ass y thie, as hoie eh sheese rish oirr ny marrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 2, 'As va earrooyn mooarey dy leih er nyn jaglym cooidjagh huggey, myr shen dy jagh eh er board lhong, as hoie eh sheese, as va ooilley yn pobble nyn shassoo er y traie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 3, 'As loayr eh mooarane reddyn roo ayns coraaghyn-dorraghey, gra, Cur-jee my-ner, hie correyder magh dy chuirr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 4, 'As myr v\'eh cuirr, huitt paart jeh\'n rass rish oirr y raad, as haink ny eeanlee, as d\'ee ad seose eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 5, 'Huitt paart er thalloo cloaie, raad nagh row mooarane ooir as daase eh er-y-chooyl, er-yn-oyr nagh row diunid hallooin echey:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 6, 'As tra ghow yn ghrian niart, ve fiojit; as er-yn-oyr nagh row eh er n\'ghoaill fraue, ren eh shymley ersooyl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 7, 'As huitt paart mastey drineyn: as daase ny drineyn seose as phloogh ad eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 8, 'Agh huitt cooid elley jeh ayns thalloo mie, as dymmyrk eh mess, paart keead-filley paart three-feed-filley, as paart jeih fillaghyn as feed.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 9, 'Eshyn ta cleayshyn echey dy chlashtyn, lhig da clashtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 10, 'As haink e ostyllyn huggey, as dooyrt ad rish, Cre\'n-fa t\'ou loayrt roo ayns coraaghyn-dorraghey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 11, 'Dreggyr eshyn, as dooyrt eh roo, Er-yn-oyr dy vel eh er ny choyrt diuish folliaghtyn reeriaght niau y hoiggal, agh dauesyn cha vel eh er ny choyrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 12, 'Son quoi-erbee ta echey, dasyn vees er ny choyrt, as bee towse s\'feoiltey er ny choyrt da: agh quoi-erbee nagh vel echey, veihsyn vees shen ny ta echey, er ny ghoaill ersooyl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 13, 'Shen-y-fa ta mee loayrt roo ayns coraaghyn-dorraghey: er-yn-oyr, ga dy vel ad fakin, cha vel ad cur-my-ner: as clashtyn cha vel ad cur geill, chamoo t\'ad toiggal.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 14, 'As ayndoosyn ta cooilleenit phadeyrys Esaias, ta gra, Ayns clashtyn, cluinnee shiu, agh cha jean shiu toiggal: as ayns fakin, hee shiu, agh cha der shiu my-ner');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 15, 'Son ta cree yn phobble shoh er n\'aase roauyr, as ta ny cleayshyn oc moal dy chlashtyn, as ny sooillyn oc t\'ad er n\'yeigh; er-aggle dy vaikagh ad lesh nyn sooillyn, as dy gluinnagh ad lesh nyn gleayshyn, as dy doiggagh ad lesh nyn gree, as dy beagh ad er nyn jyndaa, as dy jinnin ad y lheihys');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 16, 'Agh bannit ta ny sooillyn euish, son t\'ad fakin, as ny cleayshyn eu, son t\'ad clashtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 17, 'Son dy firrinagh ta mee gra riu, dy vel ymmodee phadeyryn as deiney cairagh er ve aignagh dy akin ny reddyn ta shiuish dy akin, agh cha vel ad er vakin ad: as dy chlashtyn ny reddyn ta shiuish dy chlashtyn, agh cha vel ad er chlashtyn ad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 18, 'Clasht-jee er-y-fa shen coraa-dorraghey yn chorreyder.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 19, 'Quoi-erbee ta clashtyn goo yn reeriaght, as nagh vel dy hoiggal eh, ta\'n drogh er cheet, as tayrtyn lesh shen ny va cuirt ayns e chree: shoh eh ghow yn rass rish oirr y raad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 20, 'Agh eshyn ghow yn rass ayns ynnydyn claghagh, shen eh ta clashtyn y goo, as jeeragh lesh boggey dy ghoaill eh:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 21, 'Foast cha vel fraue echey ayn hene agh t\'eh cummal rish son tammylt: agh tra ta seaghyn as tranlaase cheet er, er coontey yn ghoo chelleeragh ta e chredjue failleil.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 22, 'Eshyn myrgeddin ghow yn rass mastey ny drineyn, yn fer ta clashtyn y goo: as ta kiarail y theihll shoh, as molteyrys berchys plooghey yn goo, as te cheet dy ve ne vessoil.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 23, 'Agh eshyn ghow yn rass ayns thalloo mie, shen eh ta clashtyn y goo as dy hoigg eh, as t\'eh tilgey mess, as gymmyrkey, paart keead-filley, paart three feed, as paart jeih fillaghyn as feed.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 24, 'Coraa-dorraghey elley loayr eh roo gra, Ta reeriaght niau er ny hoylaghey gys dooinney chuirr rass mie ayns e vagher:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 25, 'Agh choud as va sleih nyn gadley haink e noid, as chuirr eh coggyl mastey y churnaght, as jimmee eh roish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 26, 'Agh tra va\'n chass er n\'aase, as e n\'gholl my-yeish, eisht haink y coggyl rish myrgeddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 27, 'Er shen haink fir-vooinjerey yn er-thie, as dooyrt ad rish, Vainshter, nagh chuirr uss rass mie ayns dty vagher? cre voish eisht ta\'n coggyl t\'ayn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 28, 'Dooyrt eshyn roo, Noid t\'er n\'yannoo shoh. Dooyrt ny fir-vooinjerey rish, Nailt eisht shin dy gholl as dy ghaartlian ass eh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 29, 'As dooyrt eshyn, Cha naill-ym; er aggle ayns gaartlian yn coggyl, dy n\'astyrt shiu yn churnaght myrgeddin ass ny fraueyn marish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 30, 'Lhig-jee daue ny-neesht gaase cooidjagh derrey\'n fouyr: as ayns earish yn ouyr jir-yms rish ny beayneeyn, Chymsee-jee cooidjagh hoshiaght yn coggyl ayns bunneeyn ry-hoi lostey; agh tayrn-jee yn churnaght stiagh ayns my hoalt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 31, 'Coraa-dorraghey elley loayr eh roo, gra, Ta reeriaght niau goll-rish grine dy rass mustard ghow dooinney, as chuirr eh ayns e vagher eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 32, 'As ga dy nee eh sloo jeh dy chooilley rass: foast tra te er n\'aase, eh smoo ta mastey lossreeyn, as te cheet dy ve ny villey: myr shen dy vel eeanlee yn aer cheet as goaill fastee ayns ny banglaneyn echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 33, 'Coraa-dorraghey elley loayr eh roo, Ta reeriaght niau goll-rish soorid ren ben y ghoaill as coodaghey seose ayns three towseyn dy veinn, derrey va\'n clane soorit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 34, 'Ooilley ny goan shoh loayr Yeesey rish y pobble ayns coraaghyn-dorraghey, as fegooish coraa-dorraghey, cha loayr eh roo:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 35, 'As shoh myr va cooilleenit shen loayr y phadeyr, gra, Foshlym my veeal dy loayrt coraaghyn-dorraghey, soilshee-ym magh reddyn t\'er ve follit er-dy hoshiaght y theihll.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 36, 'Eisht hug Yeesey yn cheshaght ersooyl, as hie eh stiagh ayns y thie: as haink huggey adsyn va sheer marish, gra, Soilshee dooin coraa dorraghey coggyl yn vagheragh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 37, 'Dreggyr eshyn as dooyrt eh roo Eshyn chuirr yn rass mie, Mac yn dooinney:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 38, 'Yn magher yn seihll: yn rass mie cloan y reeriaght: agh y coggyl cloan y drogh-er:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 39, 'Yn noid chuirr ad yn Jouyl: yn fouyr jerrey yn theihll: as ny beayneeyn ny ainleyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 40, 'Myr, er-y-fa shen, ta\'n coggyl er ny haglym, as er ny lostey ayns yn aile; shen myr vees eh ec jerrey\'n theihll.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 41, 'Ver yn Mac dooinney magh e ainleyn, as teiyee ad ass e reeriaght dy chooilley nhee ta tayrn sleih gys peccah, as adsyn ta cur rish yn olk;');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 42, 'As tilgee ad ad ayns coirrey aileagh: ayns shen vees keayney as snaggeraght feeacklyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 43, 'Eisht nee yn chloan chairagh soilshean magh myr y ghrian, ayns reeriaght nyn Ayrey. Eshyn ta cleayshyn echey dy chlashtyn, lhig da clashtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 44, 'Reesht ta reeriaght niau goll-rish berchys follit ayns magher: yn verchys cheddin tra ta dooinney dy gheddyn magh t\'eh dy choodaghey eh, as ayns boggey jeh t\'eh goll as creck ooilley ny t\'echey, as kionnaghey yn magher cheddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 45, 'Reesht ta reeriaght niau dy ve soylit rish marchan va shirrey pearlyn costal:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 46, 'As tra v\'eh er gheddyn un phearl dy phrice vooar, hie eh, as chreck eh ooilley ny v\'echey, as chionnee eh eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 47, 'Reesht ta reeriaght niau goll-rish lieen va cuirt \'sy cheayn as haare jeh dy chooilley horch dy eeast.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 48, 'As tra ve lane, hayrn ad eh gys thalloo, as hoie ad sheese, as haggil ad yn eeast mie ayns siyn, agh cheau ad yn drogh eeast ersooyl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 49, 'Shen myr vees eh ec jerrey yn theihll: hig ny ainleyn magh, as scarree ad yn vee chrauee veih mastey yn chloan chairal;');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 50, 'As tilgee ad ad ayns coirrey dy aile: ayns shen vees keayney as snaggeraght feeacklyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 51, 'Dooyrt Yeesey roo, Vel shiu er hoiggal ooilley ny reddyn shoh? Dooyrt adsyn rish, Ta shin, Hiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 52, 'Eisht dooyrt eh roo, Shen-y-fa ta dy chooilley scrudeyr, ta ynsit gys reeriaght niau, goll-rish dooinney ta ny er-thie (mie) ta cur magh ass e hashtaghyn reddyn noa as shenn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 53, 'As haink eh gy-kione, tra va Yeesey erreish ny coraaghyn-dorraghey shoh y loayrt, dy jimmee eh veih shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 54, 'As tra v\'eh er jeet gys e heer hene, dynsee eh ad ayns ny synagogueyn oc, ayns wheesh as dy row ad atchimagh, as dy dooyrt ad, Cre voish ta creenaght as mirrillyn y dooinney shoh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 55, 'Nagh nee shoh mac y teyr? Nagh vel e voir enmyssit Moirrey, as e vraaraghyn Jamys as Joses, as Simon, as Judas?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 56, 'As nagh vel ny shayraghyn echey ooilley marin? cre voish eisht ta ooilley ny reddyn t\'ec y dooinney shoh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 57, 'As v\'ad jymmoosagh rish. Agh dooyrt Yeesey roo, Cha vel phadeyr gyn ooashley, agh ayns e heer hene, as ayns e hie hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 13, 58, 'As cha nhimmey mirril dobbree eh ayns shen, kyndagh rish y vee-chredjue oc.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 1, 'Ec y traa shen cheayll Herod yn Tetrarch jeh goo Yeesey,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 2, 'As dooyrt eh rish e ir-oik, Shoh Ean Bashtey, t\'eh er n\'irree veih ny merriu, as er-yn-oyr shen ta mirrillyn er nyn obbraghey');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 3, 'Son va Herod er ghoaill Ean, as er choyrt eh ayns geulaghyn \'sy phryssoon, er coontey Herodias ben e vraar Philip.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 4, 'Son va Ean er ghra rish, Te noi yn leigh, ee dy ve ayd son ben.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 5, 'As tra baillish v\'er choyrt eh gy-baase v\'eh ayns aggle roish y pobble, er-yn-oyr dy row ad dy ghoaill eh son phadeyr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 6, 'Agh er y laa v\'er ny reayll corrym rish y laa ruggyr Herod, ghaunse inneen Herodias ayns yn enish oc, as ghow Herod lane boggey j\'ee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 7, 'Er shen ghiall eh lesh breearrey, dy choyrt-jee cre erbee hirragh ee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 8, 'As dooyrt ish, myr va e moir er chur roee, Cur dou ayns shoh kione Ean Bashtey er claare.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 9, 'As by-hrimshey lesh y ree: ny-yeih e coontey yn vreearrey, as y vooinjer v\'ec gien marish, doardee eh (yn kione) dy v\'er ny livrey huic.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 10, 'As hug eh fys yn kione dy ve giarit jeh Ean ayns y phryssoon.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 11, 'As va\'n kione er ny choyrt er claare as livreit gys y ven-aeg, as hug ish lh\'ee eh gys e moir.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 12, 'As haink e ynseydee, as hrog ad y corp, as doanluck ad eh, as hie ad, as dinsh ad da Yeesey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 13, 'Tra cheayll Yeesey jeh, ghow eh lhuingys, as jimmee eh veih shen gys ynnyd faasagh er-lheh: as tra cheayll y pobble jeh, deiyr ad er ry nyn gosh ass ny ard-valjyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 14, 'As hie Yeesey magh, as honnick eh chaglym mooar dy leih, as v\'eh er ny veiyghey lesh chymmey orroo, as laanee eh adsyn va ching.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 15, 'As tra va\'n fastyr er, haink e ostyllyn huggey, gra, She boayl faasagh shoh, as te nish lesh yn anmys; lhig y raad da\'n cheshaght, dy vod ad goll roue gys ny baljyn cheerey, as beaghey y chionnaghey daue hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 16, 'Agh dooyrt Yeesey roo, Cha lhiass daue goll roue cur-jee shiuish beaghey daue');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 17, 'As dooyrt ad rish, Cha vel ain ayns shoh agh queig bwilleenyn, as daa eeast.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 18, 'Dooyrt eshyn, Cur-jee lhieu ad ayns shoh hym\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 19, 'As doardee eh yn pobble dy hoie sheese er y faiyr, as ghow eh ny queig bwilleenyn as y daa eeast, as yeeagh eh seose gys niau, as vannee eh, as vrish eh, as hug eh ny bwilleenyn da ny ostyllyn, as hirveish adsyn ad er y pobble.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 20, 'As ren ad ooilley gee, as v\'ad jeant magh: as hrog ad jeh\'n fooilliagh daag ad, lane daa vaskad jeig.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 21, 'As adsyn v\'er n\'ee v\'ad queig thousane dooinney, cheu-mooie jeh mraane as cloan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 22, 'As chelleeragh hug Yeesey er e ostyllyn goaill lhuingys, as goll harrish gys y cheu elley roish, choud as v\'eshyn lhiggey yn raad da\'n pobble.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 23, 'As tra v\'eh er chur y pobble ersooyl, hie eh-hene er-lheh seose er slieau, dy ghoaill padjer: as tra va\'n fastyr er jeet, v\'eh ayns shen ny-lomarcan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 24, 'Agh va\'n lhong nish ayns mean ny marrey, eiyrit noon as noal lesh ny tonnyn: son va\'n gheay nyn \'oi.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 25, 'As ayns y chiarroo arrey jeh\'n oie, haink Yeesey huc, shooyll er y cheayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 26, 'As tra honnick ny ostyllyn eh shooyll er y cheayn, v\'ad atchimagh, gra, She scaan t\'ayn; as deie ad magh ayns aggle.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 27, 'Agh chelleeragh loayr Yeesey roo, gra, Bee-jee dy yien mie, she mish t\'ayn, ny gow-jee aggle.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 28, 'As dreggyr Peddyr eh, gra, Hiarn, my she oo t\'ayn, abbyr rhym cheet hood er yn ushtey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 29, 'As dooyrt eh, Tar royd. As tra va Peddyr er jeet neose ass y lhong, huill eh er yn ushtey, dy gholl gys Yeesey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 30, 'Agh gennaghtyn yn gheay rastagh, v\'eh agglit: as aarloo dy gholl fo, dyllee eh, gra, Hiarn, saue mee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 31, 'As ayns y tullogh, heeyn Yeesey magh e laue, as haare eh eh, as dooyrt eh rish, O ghooinney faase-chredjuagh, cre\'n-fa v\'ou mee-ouryssagh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 32, 'As tra v\'ad er n\'gholl er-board y lhong, huitt yn gheay.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 33, 'Eisht haink yn cheshaght-lhuingey, as hug ad ooashley da, gra, Ayns firrinys oo Mac Yee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 34, 'As tra v\'ad er jeet harrish, haink ad gys cheer Ghennesaret.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 35, 'As tra hoig cummaltee yn voayl shen quoi v\'eh, hug ad fys magh gys ooilley yn cheer mygeayrt, as hug ad lhieu huggey ooilley adsyn va doghanit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 14, 36, 'As ghuee ad er, ynrycan dy ventyn rish oirr e gharmad: as whilleen as venn rish, v\'ad er nyn lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 1, 'Eisht haink gys Yeesey scrudeyryn as Phariseeyn veih Jerusalem, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 2, 'Cre\'n-fa ta dty ostyllyn brishey oardaghyn y chanstyr? son cha vel ad niee nyn laueyn ec goaill beaghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 3, 'Agh dreggyr eshyn, as dooyrt eh roo, Cre\'n-oyr ta shiuish brishey sarey Yee liorish nyn oardaghyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 4, 'Son hug Jee sarey, gra, Cur arrym da dty ayr as da dty voir: as, Eshyn ta gwee mollaght er ayr ny moir, lhig da ve currit dy baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 5, 'Agh ta shiuish gra, Quoi-erbee jir rish ayr ny moir, Yn chooid-choonee shen oddagh uss jerkal rish voym\'s, te gioot er ny chasherickey gys Jee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 6, 'As nagh lhiass da cooney sodjey \'choyrt da e ayr ny e voir. Ta shiu myr shoh jannoo sarey Yee gyn vree liorish ny oardaghyn eu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 7, 'Chrauee-oalsey, s\'mie ren Esaias phadeyrys jiuish, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 8, 'Ta\'n pobble shoh tayrn er-gerrey dou lesh nyn meeal, as cur ooashley dou lesh nyn meillyn, agh ta\'n cree oc foddey voym.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 9, 'Agh ayns fardail t\'ad cur ooashley dou, gynsaghey son y goo aym\'s oardaghyn deiney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 10, 'As deie eh er y pobble, as dooyrt eh roo, Eaisht-jee as toig-jee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 11, 'Cha nee shen ta goll stiagh ayns veeal ta jannoo dooinney neu-ghlen: agh ny ta cheet magh ass y veeal, shen ta jannoo neu-ghlen jeh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 12, 'Eisht haink e ostyllyn huggey, as dooyrt ad rish, Vel fys ayd dy rowl ny Phariseeyn jymmoosagh, tra cheayll ad raa shoh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 13, 'Agh dreggyr eshyn, as dooyrt eh, Bee dy chooilley villey, nagh vel my Ayr flaunyssagh er hoiaghey, er ny astyrt ass ny fraueyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 14, 'Lhig-jee daue: she leeideilee doal ad ta kione y vooinjer ghoal. As my ta\'n doal shooyll kione y doal, tuittee ad ny-neesht ayns y jeeg.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 15, 'Eisht dreggyr Peddyr, as dooyrt eh rish, Soilshee dooinyn yn coraa-dorraghey shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 16, 'Dooyrt Yeesey rish, Vel shiuish neesht foast fegooish tushtey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 17, 'Nagh vel shiu foast toiggal, cre-erbee ta goit stiagh ayns y veeal, dy vel eh goll sheese ayns y volg, as goll magh trooid y chorp?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 18, 'Agh ta ny reddyn ta cheet magh ass y veeal, cheet veih\'n chree, as t\'ad shen jannoo dooinney neu-ghlen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 19, 'Son magh veih\'n chree ta cheet drogh smooinaghtyn, dunverys, brishey-poosey, maarderys, maarlys, feanish foalsey, goan mollaghtagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 20, 'Ad shoh ny reddyn ta jannoo dooinney neu-ghlen: agh dy ee lesh laueyn nagh ve nieet, cha vel shen jannoo dooinney neu-ghlen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 21, 'Eisht hie Yeesey veih shen, as jimmee eh gys ardjyn Tyre as Sidon.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 22, 'As cur-my-ner va ben va ny Canaanite, haink magh ass ny ardjyn shen, geamagh as gra, Jean myghin orrym, O Hiarn, vac Ghavid; s\'mooar ta my inneen er ny torchaghey lesh drogh-spyrryd.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 23, 'Agh cha dug eh fockle dy ansoor jee. As haink e ostyllyn, as ghuee ad er, gra, Lhig y raad j\'ee, son t\'ee gyllagh nyn yei.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 24, 'Agh dreggyr eshyn, as dooyrt eh, Cha vel mish er my choyrt, agh gys kirree-cailjey thie Israel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 25, 'Eisht haink ee, as hug, ee ooashley da, gra, Hiarn, cooin lhiam.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 26, 'Agh dreggyr eh, as dooyrt eh, Cha vel eh cooie arran ny clienney y ghoaill, as y hilgey eh gys ny moddee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 27, 'S\'feer shen, Hiarn, dooyrt ish: foast ta ny moddee gee jeh\'n vrooillagh ta tuittym jeh boayrd nyn mainshter.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 28, 'Er shen dansoor Yeesey, as dooyrt eh r\'ee, O ven, s\'mooar ta dty chredjue: yn aghin t\'ou dy yeearree dy row ayd. As va\'n inneen eck er ny lheihys veih\'n oor cheddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 29, 'As jimmee Yeesey veih shen, as haink eh er-gerrey da faarkey Ghalilee, as hie eh seose er slieau, as hoie eh ayns shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 30, 'As haink earrooyn mooarey dy leih huggey, as nyn mast\' oc va croobee, doail, balloo, baccee, as ymmodee elley, as hug ad ad nyn lhie ec cassyn Yeesey, as ren eh ad y lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 31, 'Ayns wheesh as dy ghow ooilley\'n pobble yindys, tra honnick ad ny balloo loayrt, ny baccee slane, ny croobee shooyll as ny doail fakin, as ren ad Jee Israel y ghloyraghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 32, 'Eisht deie Yeesey er e ostyllyn, as dooyrt eh, Ta chymmey aym er y pobble, er-yn-oyr dy vel ad er ve marym nish three laa, as cha vel monney beaghey oc dy ghoaill: as cha der-ym ad ersooyl nyn drostey, er aggle dy gannooinee ad er y raad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 33, 'Dooyrt e ostyllyn rish, Cre raad yiow mayd wheesh shen dy arran \'syn aasagh, as magh lheid yn earroo mooar dy leih?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 34, 'Dooyrt Yeesey roo, Cre-woad bwilleen t\'eu? Dooyrt adsyn, Shiaght, as kuse fardalagh dy eeastyn beggey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 35, 'As doardee eh da\'n pobble dy hoie er y thalloo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 36, 'As ghow eh ny shiaght bwilleenyn, as ny eeastyn, as hug e booise, as vrish eh, as hug eh ad da e ostyllyn, as hirveish adsyn er y pobble ad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 37, 'As ren ad ooilley gee, as v\'ad er nyn yannoo magh: as hrog ad jeh\'n fooilliagh va er-mayrn lane shiaght baskadyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 38, 'As v\'adsyn ren gee, kiare thousane dooinney, marish mraane as cloan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 15, 39, 'As hug eh ersooyl yn pobble, as ghow eh lhuingys, as haink eh gys ardjyn Vagdala.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 1, 'As haink ny Phariseeyn as ny Sadduceeyn dy phrowal eh, as hir ad er, eh dy yeeaghyn cowrey ennagh daue veih niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 2, 'Dreggyr eshyn, as dooyrt eh roo, Tra ta\'n fastyr er, jir shiuish, Bee emshyr aalin ayn: son dy vel jirgid \'syn aer.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 3, 'As ayns y voghrey, Bee emshyr vroghe ayn jiu; son ta\'n aer jiarg as dullyr. O shiuish chrauee-oalsey, ta toiggal eu kys dy ghoaill baght jeh neeal yn aer, as nagh vod shiu baght y ghoaill jeh cowraghyn ny hearishyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 4, 'She drogh-heeloghe as neu-ghooghyssagh ta shirrey cowrey, as cha bee cowrey er ny chur daue, agh cowrey yn adeyr Jonas. As daag eh ad, as jimmee eh roish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 5, 'Nish tra va e ostyllyn er n\'aagail y cheu elley, v\'ad er yarrood arran y chur');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 6, 'Eisht dooyrt Yeesey roo, Gow-jee twoaie, as bee-jee er nyn arrey noi soorid ny Phariseeyn as ny Sadduceeyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 7, 'As loayr ad re-cheilley, gra, Ta shoh er yn oyr nagh dug shin lhien arran.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 8, 'Tra hoig Yeesey shoh, dooyrt eh roo, Gheiney faase-chredjuagh, cre\'n-fa ta shiu resooney riu hene son nagh dug shiu lhieu arran?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 9, 'Nagh vel shiu foast toiggal, as nagh vel cooinaghtyn eu er ny queig bwilleenyn ren magh ny queig thousaneyn, as cre whilleen baskad d\'ooilliagh v\'eu?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 10, 'Ny er ny shiaght bwilleenyn ren magh ny kiare thousaneyn, as cre-woad baskad hrog shiu?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 11, 'Kys te nagh vel shiu goaill eu hene nagh nee er arran va mee cheet, agh shiu dy ghoaill twoaie jeh soorid ny Phariseeyn as ny Sadduceeyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 12, 'Eisht hoig ad nagh dug eh raaue daue noi soorid arran, agh noi ynsagh ny Phariseeyn as ny Sadduceeyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 13, 'Tra va Yeesey er jeet gys ardjyn Cesarea Philippi, denee eh jeh e ostyllyn, gra, Cre ta deiney dy ghra my-mychione\'s, Mac y dooinney, quoi mee hene?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 14, 'Dooyrt adsyn, Ta paart gra dy nee Ean Bashtey oo, as paart Elias, as ta feallagh elley gra dy nee Jeremias oo, ny fer jeh ny phadeyryn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 15, 'Dooyrt eshyn roo, Agh quoi ta shiuish gra, dy vel mee?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 16, 'Dreggyr Simon Peddyr, as dooyrt eh, Uss yn Creest, Mac y Jee bio.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 17, 'Dansoor Yeesey, as dooyrt eh rish, Bannit t\'ou uss Simon mac Jona: son cha nee feill as fuill t\'er hoilshaghey shoh dhyt\'s agh my Ayr t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 18, 'As ta mee myrgeddin gra rhyt, Dy nee uss Peddyr, as dy nee er y chreg shoh trog-ym\'s my agglish: as cha vow giattyn niurin yn varriaght urree.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 19, 'As ver-yms dhyt\'s ogheryn reeriaght niau: as cre-erbee chianglys oo er y thalloo, bee eh kianlt ayns niau: as cre-erbee eayslys oo er y thalloo, bee eh er ny eaysley ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 20, 'Eisht hug eh currym er e ostyllyn gyn ad dy insh da dooinney erbee, dy nee eshyn va Yeesey yn Creest.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 21, 'Veih yn traa shen magh ren Yeesey toshiaght dy hoilshaghey da e ostyllyn, kys dy beign da goll seose gys Jerusalem, as goll fo mooarane surranse veih\'n chanstyr, as ny ard-saggyrtyn, as ny scrudeyryn, as dy beagh eh er ny choyrt gy baase, agh dy n\'irragh eh reesht er y trass laa.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 22, 'Eisht ghow Peddyr eh er-lheh, as ghow eh toshiaght dy choyrlaghey eh, gra, Foddey dy row eh void, Hiarn, lheid shoh dy haghyrt dhyt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 23, 'Agh hyndaa eshyn, as dooyrt eh rish Peddyr, Ass my enish, y violeyder, t\'ou cur ribbey ayns my raad: son cha vel ennaghtyn ayd jeh ny reddyn ta bentyn rish Jee, agh jeh ny reddyn ta bentyn rish deiney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 24, 'Eisht dooyrt Yeesey rish e ostyllyn My ta dooinney erbee aggindagh geiyrt orrym\'s, lhig da eh-hene y obbal, as e chrosh y hroggal, as geiyrt orrym.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 25, 'Son quoi-erbee baillish e vioys y hauail, caillee eh eh: as quoi-erbee chaillys e vioys er my ghraih\'s, sauee eh eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 26, 'Son cre\'n vondeish t\'ec dooinney, my chosnys eh yn seihll ooilley, as e annym hene y choayl? ny cre nee dooinney y choyrt ayns coonrey son e annym?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 27, 'Son hig Mac y dooinney ayns gloyr e Ayrey, as e ainleyn casherick marish: as ec y traa shen cooilleenee eh da dy chooilley ghooinney cordail rish e obbraghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 16, 28, 'Dy firrinagh ta mee gra riu, Dy vel paart nyn shassoo ayns shoh, nagh jean blashtyn er y baase, derrey hee ad Mac y dooinney cheet ayns e reeriaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 1, 'As ec kione shey laa, ghow Yeesey Peddyr, as Jamys, as Ean e vraar, as hug eh lesh ad er-lheh seose er slieau ard,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 2, 'As va\'n cummey echey er ny chaghlaa kiongoyrt roo, as ren yn eddin echey soilshean myr y ghrian, as va\'n coamrey echey gial myr y soilshey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 3, 'As cur-my-ner, honnick ad Moses as Elias taggloo rish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 4, 'Eisht dreggyr Peddyr as dooyrt eh rish Yeesey, Hiarn, s\'maynrey dooin dy hannaghtyn ayns shoh: my she dty aigney\'s eh, lhig dooin ayns shoh troggal three cabbaneyn: cabbane er dty hon\'s, as cabbane son Moses, as cabbane son Elias.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 5, 'Choud as v\'eh foast loayrt, ren bodjal sollys skeayley harrystoo: as cur-my-ner haink coraa ass y vodjal, gra, Shoh my vac ennoil, ayn ta mee goaill slane taitnys, eaisht-jee rishyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 6, 'As tra cheayll ny ostyllyn eh, huitt ad sheese er nyn eddin gys y thalloo, son s\'mooar yn aggle v\'orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 7, 'As haink Yeesey as venn eh roo, as dooyrt eh, Trog-jee erriu, as ny gow-jee aggle.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 8, 'As tra hrog ad seose nyn sooillyn, cha vaik ad fer erbee, agh Yeesey ny-lomarcan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 9, 'As myr v\'ad cheet neose jeh\'n clieau hug Yeesey currym orroo, gra, Ny insh-jee yn ashlish da unnane erbee, derrey vees Mac yn dooinney er n\'irree veih ny merriu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 10, 'As denee e ostyllyn jeh, gra, Cre\'n-oyr jir ny scrudeyryn dy vel Elias dy heet hoshiaght?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 11, 'Dansoor Yeesey as dooyrt eh roo, Hig Elias dy jarroo hoshiaght, as lhiassee eh dy chooilley nhee:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 12, 'Agh ta mish gra riu, dy vel Elias er jeet hannah, as cha dug ad geill da, agh t\'ad er ghellal rish lurg nyn aigney hene as er yn aght cheddin nee Mac y dooinney neesht surranse lioroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 13, 'Eisht hoig e Ostyllyn dy nee er Ean Bashtey v\'eh cheet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 14, 'As tra v\'ad er jeet gys y cheshaght, haink huggey dooinney dy row, gliooney sheese as gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 15, 'Hiarn, jean chymmey er my vac, son t\'eh ass e cheeayl, as dy mooar seaghnit: son t\'eh dy mennick tuittym ayns yn aile, as dy mennick ayns yn ushtey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 16, 'As hug mee lhiam eh gys dty ostyllyn, as cha yarg ad eh y lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 17, 'Dansoor Yeesey as dooyrt eh, O heeloghe vee-chredjuagh as roonagh, caid ta mish dy ve meriu? caid ta mee dy hurranse diu? cur lhiat eh hym\'s ayns shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 18, 'As vaggyr Yeesey er y drogh-spyrryd, as hie eh magh ass: as va\'n lhiannoo er ny lheihys veih\'n oor shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 19, 'Eisht haink e ostyllyn gys Yeesey er-lheh, as dooyrt ad, Cre liorish nagh voddagh shinyn eh y lheihys?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 20, 'Dooyrt Yeesey roo, Kyndagh rish nyn gredjue moal: son dy firrinagh ta mee gra riu, Dy beagh nyn gredjue wheesh grine dy rass mustard, jirragh shiu rish y slieau shoh, Scugh veih shoh noon gys shid, as nee eh scughey: as cha bee nhee erbee ro-ghoillee diu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 21, 'Ny-yeih cha vel y dooghys shoh dy ghrogh-spyrrydyn dy ve castit, agh liorish padjer as trostey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 22, 'As choud as v\'ad ayns Galilee, dooyrt Yeesey roo, Bee Mac y dooinney er ny vrah gys laueyn deiney:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 23, 'As ver ad eh gy-baase, as y trass laa nee eh girree reesht: as v\'ad feer trimshagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 24, 'As tra v\'ad er jeet gys Capernaum, haink y vooinjer va troggal argid y cheesh gys Peddyr, gra, Nagh vel y mainshter euish geeck y cheesh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 25, 'Dooyrt eshyn, Dy row. As tra v\'eh er jeet stiagh ayns y thie, va Yeesey ro-laue rish, gra, Cre t\'ou smooinaghtyn, Simon, quoi jeh ta reeaghyn y thallooin troggal custom ny keesh? jeh nyn gloan hene, ny jeh joarreeyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 26, 'Dooyrt Peddyr rish, Jeh joarreeyn. Dooyrt Yeesey rishyn, Eisht ta\'n chloan seyr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 17, 27, 'Ny-yeih, son nagh bee cumys er ny chur hooin, immee uss gys y cheayn, as lhig sheese dooan, as trog y chied eeast hig hood: as tra vees oo er vosley e veeal, yiow peesh dy argid ayn; shen gow, as eeck eh er my hon\'s as er dty hon hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 1, 'Ec y traa cheddin haink e ostyllyn gys Yeesey, gra, Quoi syrjey ta ayns reeriaght niau?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 2, 'As deie Yeesey er lhiannoo beg, as hoie eh eh kiongoyrt roo');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 3, 'As dooyrt eh, Dy firrinagh ta mee gra riu, Mannagh jean shiu chyndaa, as cheet dy ve myr cloan veggey, cha jed shiu stiagh ayns reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 4, 'Quoi-erbee er-y-fa shen, nee eh-hene y injillaghey myr y lhiannoo beg shoh, eh syrjey vees ayns reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 5, 'As quoi-erbee nee soiaghey jeh lheid y lhiannoo beg shoh ayns yn ennym aym\'s, t\'eh jannoo soiaghey jeem\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 6, 'Agh quoi-erbee ver oyr da unnane jeh\'n vooinjer veggey shoh ta credjal aynym\'s dy huittym (veih\'n chredjue) veagh eh ny baare da dy beagh clagh-wyllin er ve croghit mysh e wannal, as eh dy ve baiht ayns diunid ny marrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 7, 'Smerg da\'n theihll kyndagh rish oyryn peccah: son shegin da nyn lheid \'ve ayn; agh smerg da\'n dooinney, liorish ta\'n loght cheet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 8, 'Shen-y-fa my ta dty laue ny dty chass hene dy dty hayrn gys yn olk, giare jeed, as tilg void ad; te ny share dhyt goll stiagh ayns bea croobagh ny baccagh, na daa laue ny daa chass y ve ayd, as oo dy ve tilgit ayns yn aile dy bragh farraghtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 9, 'As my ta dty hooill dy dty hayrn gys peccah, pluck assyd, as tilg void ee: te ny share dhyt goll stiagh ayns bea lesh un hooill, na daa hooill y ve ayd, as oo dy ve tilgit ayns aile niurin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 10, 'Cur-jee twoaie nagh soie shiu beg jeh unnane jeh\'n vooinjer veggey shoh: son ta mee gra riu, dy vel ny ainleyn ocsyn ayns niau, kinjagh cur-my-ner eddin my Ayr flaunyssagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 11, 'Son ta Mac y dooinney er jeet dy hauail shen ny va caillit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 12, 'Cre ta shiu smooinaghtyn? My ta keead keyrrey ec dooinney, as unnane jeu v\'er n\'gholl er-shaghryn, nagh vel eh faagail yn chiare-feed as yn nuy-jeig, as goll gys ny sleityn, as shirrey yn cheyrrey chailjey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 13, 'As my she shen dy vel eh dy gheddyn ee, dy firrinagh ta mee gra riu, dy vel eh goaill ny smoo dy voggey jeh\'n cheyrrey shen, ny jeh\'n chiare-feed as yn nuy-jeig, nagh jagh er-shaghryn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 14, 'Er yn aght cheddin, cha nee aigney nyn Ayr t\'ayns niau eh, unnane jeh\'n vooinjer veggey shoh dy herraghtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 15, 'Myrgeddin my nee dty vraar aggair dhyt, immee as insh da e oill eddyr shiu hene nyn-lomarcan: my eaishtys eh rhyt, t\'ou er chosney dty vraar.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 16, 'Agh mannagh n\'eaisht eh rhyt, eisht gow mayrt fer ny jees elley, ayns beeal ghaa ny three dy eanishyn dy vod dy chooilley ockle ve jeant mie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 17, 'As mannagh der eh geill dauesyn, insh eh da\'n agglish: agh mannagh der eh geill da\'n agglish, jeeagh er myr an-chreestee as myr publican.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 18, 'Dy firrinagh ta mee gra riu, Cre erbee nee shiuish y chiangley er y thalloo, bee eh kianlt ayns niau: as cre-erbee nee shiu y eaysley er y thalloo, bee eh er ny eaysley ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 19, 'Reesht ta mee gra riu, my nee jees jiuish coardail er y thalloo \'syn un aghin bee nyn aghin er ny chooilleeney liorish my Ayr t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 20, 'Son raad ta ghaa ny three er nyn jaglym cooidjagh ayns m\'ennym\'s, shen y raad ta mish nyn mastey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 21, 'Eisht haink Peddyr huggey, as dooyrt eh, Hiarn, cre cha mennick as ta orrym\'s leih da my vraar, tra yioym aggair liorish? nee choud as shiaght keayrtyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 22, 'Dooyrt Yeesey rish, Cha vel mish gra rhyt, Choud as shiaght keayrtyn: agh choud as three-feed as jeih keayrtyn shiaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 23, 'Shen-y-fa ta reeriaght niau er ny hoylaghey gys ree dy row, baillish coontey rish e harvaantyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 24, 'As tra v\'eh er n\'yannoo toshiaght dy choontey, haink fer huggey va lhiastyn da jeih thousane talent.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 25, 'Agh son wheesh as nagh row echey dy eeck, doardee e hiarn eh dy ve creckit as e ven, as e chloan, as ooilley ny v\'echey, as e eeaghyn dy ve eeckit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 26, 'Huitt y charvaant er-y-fa shen sheese, as ghuee eh er, gra, Cur daill dou, Hiarn, as nee\'m ooilley y eeck dhyt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 27, 'Eisht va chiarn y charvaant shen er ny veiyghey lesh chymmey, as ren eh feaysley er, as leih eh da ny v\'eh dy lhiastyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 28, 'Agh hie yn charvaant cheddin magh, as hooar eh fer jeh e heshaghyn-sharvaant va lhiastyn keead ping da: as haare eh greme er, as ghow eh eh er y scoarnagh, gra, Eeck shen ny t\'ou dy lhiastyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 29, 'As huitt e heshey-harvaant sheese ec e chassyn, as ghuee eh er, gra, Cur daill dou as nee\'m ooilley y eeck dhyt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 30, 'Agh cha lhiggagh eh lesh: agh hie eh, as hilg eh eh ayns pryssoon, derrey eeckagh eh ny v\'eh dy lhiastyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 31, 'Myr shen tra honnick e heshaghyn-sharvaant kys hie eh er, ghow ad dy feer olk rish, as haink ad, as dinsh ad da nyn jiarn ooilley ny va er daghyrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 32, 'Eisht deie e hiarn er, as dooyrt eh rish, O ghrogh harvaant, leih mish dhyt\'s yn slane lhiastynys shen, er-yn-oyr dy ren oo lheid yn aghin hym:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 33, 'Nagh lhisagh uss myrgeddin as chymmey er ve ayd er dty heshey-harvaant, eer myr va chymmey aym\'s ort\'s?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 34, 'As va e hiarn jymmoosagh, as livrey eh seose eh gys laue y tidoor ny phryssoonagh, derrey eeckagh eh ooilley ny v\'eh dy lhiastyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 18, 35, 'Er yn aght shoh myrgeddin nee my Ayr flaunyssagh riuish, mannagh leihee shiu veih nyn greeaghyn dy chooilley ghooinney da e vraar e loghtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 1, 'As haink eh gy-kione, erreish da Yeesey v\'er loayrt ny goan shoh, dy jimmee eh veih Galilee, as dy daink eh gys ardjyn Yudea, er cheu elley dy Yordan:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 2, 'As deiyr earrooyn mooarey dy leih er, ren eh ad y lheihys ayns shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 3, 'Haink ny Phariseeyn huggey myrgeddin dy phrowal eh, as dooyrt ad rish, Vel eh lowal da dooinney e ven y chur er sooyl son dy chooilley oyr?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 4, 'Dreggyr eshyn, as dooyrt eh roo, Nagh vel shiu er lhaih, eshyn chroo ad ec y toshiaght, dy chroo eh ad fyrrynagh as bwoirrynagh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 5, 'As dooyrt eh roo, Er-yn-oyr shoh nee dooinney faagail e ayr as e voir, as lhiannee eh gys e ven: as bee ad ny-neesht un eill.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 6, 'Shen-y-fa cha vel ad ny sodjey jees, agh yn un eill. Cre-erbee er-y-fa shen ta Jee er chur cooidjagh, ny lhig da dooinney erbee y scarrey veih-my-cheilley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 7, 'Dooyrt adsyn rish, Cre\'n-oyr eisht doardee Moses screeuyn-scarree y choyrt, as y ven y chur ersooyl?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 8, 'Dooyrt eshyn roo, kyndagh rish creoghys nyn greeaghyn, lhow Moses diu nyn mraane y chur ersooyl: agh ec y toshiaght cha row eh myr shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 9, 'As ta mish gra riu, Quoi-erbee scarrys rish e ven, cheu-mooie jeh son maarderys, as phoosys ben elley, t\'eh brishey-poosey: as quoi-erbee phoosys ish ta scarrit, t\'eh brishey poosey:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 10, 'Dooyrt e ostyllyn rish, My she shoh yn chooish eddyr dooinney as e ven, cha vel eh mie dy phoosey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 11, 'Agh dooyrt eshyn roo, Cha nee dy chooilley ghooinney oddys shen y ghoaill er, agh adsyn ny-lomarcan daue te er ny choyrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 12, 'Son ta deiney gennish ayn, rug myr shen veih brein nyn mayrey: as ta deiney gennish ayn, v\'er nyn yannoo gennish liorish deiney: as ta deiney gennish ayn, t\'er n\'yannoo ad-hene gennish er graih reeriaght niau. Eshyn oddys shoh y ghoaill er, lhig da \'ghoaill eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 13, 'Eisht hug ad lhieu huggey cloan veggey, dy chur e laueyn orroo, as dy vannaghey ad: as hug e ostyllyn oghsan daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 14, 'Agh dooyrt Yeesey, Sur-jee cloan aegey, as ny jean-jee ad y lhiettal dy heet hym\'s: son jeh nyn lheid ta reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 15, 'As hug eh e laueyn orroo, as jimmee eh veih shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 16, 'As cur-my-ner, haink fer huggey, as dooyrt eh rish, Vainshter vie, cre\'n obbyr ne lhisins y yannoo dy chosney yn vea veayn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 17, 'As dooyrt eshyn rish, Cre\'n-fa t\'ou genmys mish mie? cha vel ayn ny ta mie, agh unnane, ynrycan Jee: agh my sailts goll stiagh ayns bea, freill ny annaghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 18, 'Dooyrt eshyn rish, Cre ny annaghyn? Dooyrt Yeesey, Cha jean oo dunverys, Cha brish oo poosey, Cha jean oo geid, Cha n\'ymmyrk oo feanish foalsey,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 19, 'Cur arrym da dty ayr as da dty voir: as, Ver oo graih da dty naboo myr dhyt hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 20, 'Dooyrt y dooinney aeg rish, Ooilley ny annaghyn shoh ta mee er vreayll veih my aegid: cre sodjey t\'orrym dy vannoo?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 21, 'Dooyrt Yeesey rish, My sailt ve dy firrinagh mie, immee, as creck, as cur ny t\'ayd da ny boghtyn, as bee berchys ayd ayns niau; as tar as eiyr orrym\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 22, 'Agh tra cheayll yn dooinney aeg yn raa shen, hie eh ersooyl dy trimshagh: son va state mooar hallooin echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 23, 'Eisht dooyrt Yeesey rish e ostyllyn, Dy firrinagh ta mee gra riu, S\'doillee hed dooinney berchagh stiagh ayns reeriaght niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 24, 'As reesht ta mee gra riu, Te ny sassey da camel goll trooid croae snaidey, na da dooinney berchagh dy gholl stiagh ayns reeriaght Yee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 25, 'Tra cheayll e ostyllyn shoh, ghow ad yindys erskyn-towse, gra, Quoi eisht oddys ve er ny hauail?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 26, 'Agh yeeagh Yeesey orroo, as dooyrt eh roo, Gys deiney ta shoh neu-phossible, agh da Jee ta dy chooilley nhee possible.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 27, 'Eisht dreggyr Peddyr, as dooyrt eh rish, Cur-my-ner, ta shinyn er dreigeil ooilley, as er n\'eiyrt ort\'s; cre yiow mainyn er-y-fa shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 28, 'Dooyrt Yeesey roo, Dy firrinagh ta mee gra riu, \'Sy stayd noa, tra nee Mac y dooinney soie er stoyl-reeoil e ghloyr, dy jean shiuish myrgeddin t\'er n\'eiyrt orrym\'s soie er daa stoyl-reeoil yeig, briwnys daa heeloghe yeig Israel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 29, 'As dy chooilley unnane t\'er hreigeil thieyn, ny braaraghyn, ny shayraghyn, ny ayr, ny moir, ny ben, ny cloan, ny thalloo, er graih m\'ennym\'s, yiow ad keead filley, as eiraght ayns y vea veayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 19, 30, 'Agh bee ymmodee jeusyn ta hoshiaght, er-jerrey; as jeusyn ta er-jerrey hoshiaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 1, 'Son ta reeriaght niau casley rish dooinney va ny er-thie, hie magh dy moghey dy ailley labreeyn son e gharey-feeyney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 2, 'As tra v\'eh er choardail rish ny labreeyn son ping \'sy laa, hug eh ad stiagh ayns e gharey-feeyney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 3, 'As hie eh magh mysh y trass oor, as honnick eh feallagh elley shassoo nyn daaue \'syn ynnyd-margee,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 4, 'As dooyrt eh roo, Immee-jee shiuish myrgeddin gys y gharey-feeyney, as cre erbee ta cair, shen yiow shiu. As hie ad rhymboo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 5, 'Reesht hie eh magh mysh y cheyoo as yn nuyoo oor, as ren eh er yn aght cheddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 6, 'As mysh yn un oor jeig, hie eh magh, as hooar eh feallagh elley shassoo nyn daaue, as dooyrt eh roo, Cre\'n-fa ta shiu nyn shassoo ayns shoh fey ny laa nyn daaue?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 7, 'Dooyrt adsyn rish, Er-yn-oyr nagh vel dooinney erbee er vailley shin. Dooyrt eshyn roo, Immee-jee shiuish myrgeddin gys y gharey-feeyney, as yiow shiu cre-erbee ta cair.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 8, 'Myr shen tra va\'n fastyr er jeet, dooyrt chiarn y gharey-feeyney rish y stiurt echey, Eie er ny labreeyn, as cur daue nyn vaill, goaill toshiaght veih yn vooinjer s\'jerree gys y chied eallagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 9, 'As tra haink feallagh yn un oor jeig hooar ad dagh dooinney jeu ping y pheesh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 10, 'Agh tra haink y chied eallagh, heill ad dy voghe ad ny smoo, as hooar adsyn myrgeddin dagh dooinney e phing.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 11, 'As tra v\'ad er ghoaill eh, ren ad tallagh noi yn er-thie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 12, 'Gra, Cha vel yn vooinjer s\'jerree shoh er n\'obbraghey agh un oor, as t\'ou er n\'yannoo ad corrym rooinyn ta er n\'ymmyrkey yn errey as chiass y laa.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 13, 'Agh dreggyr eshyn fer jeu, gra, Heshey vie, cha vel mish jannoo aggair dhyt: nagh choard uss rhym\'s son ping?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 14, 'Trog shen ny ta lhiat, as immee royd: m\'aigney\'s eh dy choyrt da\'n fer s\'jerree shoh, myr ta mee er chur dhyt\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 15, 'Nagh vel eh lowal dou dy yannoo cre saillym rish my chooid hene? vel dty hooill\'s olk, er-yn-oyr dy vel mish mie?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 16, 'Myr shen bee adsyn ta er-jerrey hoshiaght, as adsyn ta hoshiaght er-jerrey: son shimmey t\'er nyn eam, agh s\'tiark t\'er nyn reih.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 17, 'As myr va Yeesey goll seose gys Jerusalem, ghow eh yn daa ostyl yeig dy lhiattee er y raad, as dooyrt eh roo,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 18, 'Cur-my-ner ta shin goll seose gys Jerusalem, as bee Mac y dooinney er ny vrah gys ny ard-saggyrtyn, as gys ny scrudeyryn, as deyree ad eh gy-baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 19, 'As livreyee ad seose eh gys ny Ashoonee, as nee ad faghid er, as eh y scuitchal, as y chrossey: as er y trass laa nee eh girree reesht (veih ny merriu).');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 20, 'Eisht haink huggey moir cloan Zebedee, as e mec maree, cur ooashley da, as shirrey aghin er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 21, 'As dooyrt eh r\'ee, Cre ta dty yeearree? Dooyrt ish rish, Giall daue shoh my ghaa vac dy hoie, yn derrey yeh er dty laue yesh, as y jeh elley er dty laue hoshtal ayns dty reeriaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 22, 'Agh dreggyr Yeesey as dooyrt eh, Cha vel fys eu hene cre ta shiu dy yeearree. Vod shiu giu jeh\'n cappan ta mish giu jeh, as v\'er nyn mashtey lesh y bashtey ta mish dy ve bashtit lesh? Dooyrt adsyn rish, Foddee mayd.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 23, 'As dooyrt eh roo, Iuee shiu dy jarroo jeh my chappan, as bee shiu er nyn mashtey lesh y bashtey ta mish dy ve bashtit lesh: agh dy hoie er my laue yesh, as er my laue hoshtal, cha vel shen lhiam\'s dy-choyrt, agh ny-lomarcan dauesyn er nyn son te kiarit liorish my Ayr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 24, 'As tra cheayll yn jeih shoh, v\'ad feer jymmoosagh rish y daa vraar.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 25, 'Agh deie Yeesey orroo huggey, as dooyrt eh, Ta fys eu dy vel princeyn ny Hashoonee gymmyrkey chiarnys harrystoo, as ta ny ard-gheiney gymmyrkey reill orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 26, 'Agh cha bee shillish myr shen: agh quoi-erbee jiuish baillish ve ooasle, lhig da ve nyn shirveishagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 27, 'As quoi-erbee baillish ve yn ard-ghooinney nyn mast\' eu, lhig da ve yn charvaant eu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 28, 'Myr nagh daink yn Mac dooinney dy ve shirveishit er, agh dy hirveish, as dy chur e vioys ny lhiassaghey son ymmodee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 29, 'As tra v\'ad er n\'immeeaght veih Jericho deiyr earrooyn mooarey dy leih er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 30, 'As cur-my-ner, va daa ghooinney doal nyn soie rish oirr yn raad, as tra cheayll ad dy row Yeesey goll shaghey, deie ad, gra, Jean myghin orrin, O Hiarn, vac Ghavid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 31, 'As hooar yn pobble foill daue, ad dy ve nyn-dhost: agh deie adsyn wheesh shen smoo, gra, Jean myghin orrin, O Hiarn, vac Ghavid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 32, 'As hass Yeesey, as deie eh orroo, as dooyrt eh, Cre bailliu mee dy yannoo er ny son eu?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 33, 'Dooyrt adsyn rish, Hiarn, dy vod ny sooillyn ain v\'er nyn vosley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 20, 34, 'Myr shen va chymmey ec Yeesey orroo, as venn eh rish ny sooillyn oc: as chelleeragh hooar ny sooillyn oc nyn soilshey, as deiyr ad er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 1, 'As tra v\'ad tayrn er-gerrey da Jerusalem, as dy row ad er jeet gys Bethphage, gys cronk ny Oliveyn, hug Yeesey jees jeh e ostyllyn er chaghteraght,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 2, 'As dooyrt eh roo, Immee-jee gys y balley-cheerey ta shiu dy akin, as chelleeragh yiow shiu assyl kianlt as lhiy maree: feayshil-jee as cur-jee lhieu ad hym\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 3, 'As my loayrys dooinney erbee veg riu, abbyr-jee shiuish, Ta feme ec y Chiarn orroo; as chelleeragh lhiggee eh yn raad daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 4, 'Va ooilley shoh jeant, dy voddagh shen ve cooilleenit va loayrit liorish y phadeyr gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 5, 'Insh-jee da inneen Sion, Cur-my-ner, ta dty ree cheet hood dy imlee, as ny hoie er assyl, as er lhiy sharragh assyl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 6, 'As hie adsyn rhymboo, as ren ad myr va Yeesey er n\'oardaghey daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 7, 'As hug ad lhieu yn assyl as y lhiy, as hug ad orroo nyn eaddeeyn, as hug ad eshyn ny hoie orroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 8, 'As ren earrooyn mooarey dy leih skeayley nyn gharmadyn er y raad; yiare feallagh elley banglaneyn jeh ny biljyn, as skeayl ad ad er y raad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 9, 'As deie yn pobble hie roish, as adsyn haink ny yei, gra, Hosanna gys mac Ghavid: bannit t\'eshyn ta cheet ayns ennym y Chiarn, Hosanna ayns yn yrjid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 10, 'As tra v\'eh er jeet gys Jerusalem, va ooilley yn ard-valley ayns anvea, gra, Quoi eh shoh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 11, 'Dooyrt y pobble, Shoh Yeesey yn phadeyr, ta veih Nazareth ayns Galilee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 12, 'As hie Yeesey stiagh ayns chiamble Yee, as deiyr eh magh ooilley adsyn va creck as kionnaghey ayns y chiamble, as hilg eh harrish ny buird ocsyn va caghlaa argid, as ny stuill ocsyn va creck calmaneyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 13, 'As dooyrt eh roo, Te scruit, Bee my hie\'s enmyssit thie yn phadjer, agh ta shiuish er n\'yannoo eh ny ooig dy vaarlee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 14, 'As haink ny doail as ny croobee huggey gys y chiamble, as ren eh ad y lheihys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 15, 'As tra honnick ny ard-saggyrtyn as ny scruderyn ny reddyn yindyssagh v\'eh dy yannoo, as ny paitchyn geamagh ayns y chiamble, as gra, Hosanna gys mac Ghavid, v\'ad feer chorree.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 16, 'As dooyrt ad rish, Vel oo clashtyn cre t\'ad shoh dy ghra? Dooyrt Yeesey roo, Ta mee; nagh lhaih shiuish rieau, Magh ass beill oikanyn as cloan er y cheeagh t\'ou er gheddyn moylley firrinagh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 17, 'As daag eh ad, as hie eh magh ass yn ard-valley gys Bethany, as ghow eh aaght ayns shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 18, 'Nish ayns y voghrey, myr v\'eh goll reesht gys yn ard-valley, v\'eh accryssagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 19, 'As tra honnick eh billey-figgagh er y raad, haink eh huggey, as cha dooar eh monney er, agh ynrycan duillagyn, as dooyrt eh rish, Nar aase mess erbee ort\'s veih shoh magh er son dy bragh. As chelleeragh ren y billey-figgagh fioghey ersooyl.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 20, 'As tra honnick e ostyllyn shoh, ghow ad yindys, gra, Cre cha leah as ta\'n billey figgagh er chreenagh roish?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 21, 'Dreggyr Yeesey, as dooyrt eh roo, Dy firrinagh ta mee gra riu, My vees shiu credjuagh, as gyn ve fo mee-ourys erbee, nee shiu cha nee ynrycan shoh ta jeant rish y villey-figggagh, agh my jir shiu rish y slieau shoh, Bee er dty scughey, as er dty hilgey ayns y cheayn; bee eh er ny yannoo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 22, 'As cre-erbee nee shiu geearree ayns padjer, lesh credjue, yiow shiu eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 23, 'As tra v\'eh er jeet stiagh ayns y chiamble, haink ny ard-saggyrtyn as shanstyr yn phobble huggey myr v\'eh gynsaghey, gra, Cre\'n phooar t\'ayd\'s dy yannoo ny reddyn shoh? as quoi hug yn phooar shoh dhyt?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 24, 'As dreggyr Yeesey as dooyrt eh roo, Fenym\'s jiuish un red; as my inshys shiu dou eh, inshym\'s myrgeddin diuish, cre\'n phooar t\'aym dy yannoo ny reddyn shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 25, 'Bashtey Ean, cre voish ve? veih niau, ny veih deiney? As loayr ad nyn mast\' oc hene, gra, My jir mayd, Veih niau; jir eshyn rooin, Cre\'n-fa eisht nagh chred shiu eh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 26, 'Agh my jir mayd, Veih deiney; ta aggle orrin roish y pobble; son ta dy chooilley ghooinney goaill Ean son phadeyr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 27, 'As dreggyr ad Yeesey, as dooyrt ad, Cha vod mayd ginsh. As dooyrt eh roo, Chamoo ta mish ginsh diuish, cre\'n phooar t\'aym, dy yannoo ny reddyn shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 28, 'Agh cre ta shiu dy smooinaghtyn? Va dooinney dy row as daa vac echey, as haink eh gys yn er-shinney, as dooyrt eh, Vac, Immee as obbree jiu ayns my gharey-feeyney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 29, 'Dreggyr eshyn as dooyrt eh, Cha jem: agh ny lurg shen ghow eh arrys, as hie eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 30, 'As haink eh gys e vac saa, as loayr eh rish myrgeddin. As dreggyr eshyn, as dooyrt eh, Hem, vainshter; as cha jagh eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 31, 'Quoi jeu shoh ny-neesht ren aigney e ayrey? Dooyrt adsyn rish, Yn mac shinney. Dooyrt Yeesey roo, Dy firrinagh ta mee gra riu, dy jed ny publicanee as ny drogh. vraane stiagh ayns reeriaght Yee reue-ish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 32, 'Son haink Ean hiuish ayns raad y chairys, as cha chred shiu eh: agh chred ny publicanee as ny drogh-vraane eh. As ga dy vaik shiu shoh, cha ghow shiu arrys ny lurg shen, dy chredjal ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 33, 'Eaisht-jee rish coraa-dorraghey elley: Va fer-thie dy row ren garey-feeyney y hoiaghey, as ren eh cleigh y yannoo mysh, as chleiy eh press-feeyney ayn, as hrog eh toor, as hoie eh eh rish tannys, as hie eh gys cheer foddey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 34, 'As tra va earish ny mess tayrn er-gerrey, hug eh e ir-vooinjerey gys y tannys, dy gheddyn jeh\'n mess echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 35, 'As ghow yn tannys e ir-vooinjerey, as woaill ad fer, as varr ad fer elley, as chlagh ad fer elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 36, 'Reesht hug eh magh sharvaantyn elley ny s\'lhee na\'n chied eallagh: as ghell ad roosyn er yn aght cheddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 37, 'Agh er-jerrey ooilley hug eh huc e vac, gra, Bee ad arrymagh da my vac.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 38, 'Agh tra honnick y tannys yn mac dooyrt ad nyn mast\' oc hene, Shoh\'n eirey, tar-jee, lhig dooin eh y varroo, as bee\'n eiraght echey lhien hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 39, 'As ghow ad eh, as hilg ad eh magh ass y gharey-feeyney, as varr ad eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 40, 'Tra hig er-y-fa shen Chiarn y gharey-feeyney, Cre nee eh rish yn tannys shen?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 41, 'Dooyrt adsyn rish, Stroie-ee eh fegooish myghin ny drogh-gheiney shen, as nee eh soiaghey yn garey-feeyney rish tannys elley, livrey-ys ny messyn da ayns nyn imbagh cooie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 42, 'Dooyrt Yeesey roo, Nagh lhaih shiu rieau ayns goo Yee, Yn chlagh ren ny masoonee y vee-lowal, ta\'n chlagh cheddin er jeet dy ve yn ard-chlagh chorneilagh: shoh jannoo yn Chiarn, as te yindyssagh ayns ny sooillyn ainyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 43, 'Shen-y-fa ta mish gra riu, Dy bee reeriaght Yee er ny ghoaill veue-ish, as er ny choyrt da ashoon ymmyrkys magh yn mess echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 44, 'As quoi-erbee huittys er y chlagh shen bee eh er ny vroo: agh er quoi-erbee huittys y chlagh shen, nee ee cha meen as joan jeh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 45, 'As tra va ny ard-saggyrtyn as ny Phariseeyn erreish ny coraaghyn-dorraghey echey y chlashtyn, dennee ad dy nee jeusyn v\'eh loayrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 21, 46, 'Agh tra v\'ad shleeuit er goaill eh v\'ad ayns aggle roish y pobble, er-yn-oyr dy row ad jeeaghyn er dy ve ny adeyr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 1, 'As dreggyr Yeesey, as loayr eh roo reesht liorish coraaghyn-dorraghey, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 2, 'Ta reeriaght Yee er ny hoylaghey gys ree dy row, ren bannish son e vac');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 3, 'As hug eh magh e harvaantyn dy eamagh orroosyn va cuirt gys y vannish: as cha balliu cheet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 4, 'Reesht hug eh magh sharvaantyn elley, gra, Abbyr-jee roosyn ta cuirt, Cur-my-ner ta mee er n\'aarlaghey my yinnair: ta my ghew as my veiyn beiyht marroo, as dy chooilley nhee ullee; tar-jee gys y vannish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 5, 'Agh hoie adsyn beg jeh as hie ad rhymboo, fer gys e state-hallooin, as fer elley gys e varchantys');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 6, 'As ghow yn chooid elley ny sharvaantyn echey, as ghell ad dy elgyssagh roo, as varr ad ad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 7, 'Agh tra cheayll y ree jeh v\'eh feer chorree: as hug eh magh e heshaghtyn caggee, as stroie eh ny dunveryn shen, as losht eh yn ard-valley oc.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 8, 'Eisht dooyrt eh rish e harvaantyn, Ta\'n vannish aarloo, agh y vooinjer va cuirt cha row ad feeu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 9, 'Gow-jee magh er-y-fa shen gys ny raaidyn mooarey, as whilleen as yiow shiu, cuir-jee gys y vannish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 10, 'As hie ny sharvaantyn shen magh gys ny raaidyn-mooarey, as ren ad whilleen as haink nyn raad y haglym cooidjagh, chammah sie as mie: as va thie ny banshey er ny lhieeney lesh goaldee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 11, 'As tra haink y ree stiagh dy akin ny goaldee, honnick eh dooinney ayns shen nagh row garmad-banshey er:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 12, 'As dooyrt eh rish, Heshey vie, kys haink uss stiagh ayns shoh, fegooish garmad-banshey? As cha row fockle echey dy ghra.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 13, 'Eisht dooyrt y ree rish ny sharvaantyn, Kiangle-jee eh laue as cass, as gow-jee eh ersooyl, as tilg-jee eh ayns y dorraghys sodjey-mooie: shen-y-raad vees keayney as snaggeraght feeacklyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 14, 'Son shimmey t\'er nyn eam, agh s\'tiark t\'er nyn reih.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 15, 'Eisht hie ny Phariseeyn, as hug ad nyn goyrle dy cheilley, kys dy ghoaill vondeish er ayns e ghoan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 16, 'As hug ad magh huggey shiartanse jeusyn v\'ad hene er n\'ynsaghey marish ny Herodianee, gra, Vainshter, ta fys ain dy vel oo firrinagh, as dy vel oo gynsaghey raad Yee syn ynrickys, chamoo t\'ou ayns aggle roish dooinney erbee: son cha vel oo soiaghey jeh persoon deiney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 17, 'Insh dooin er-y-fa shen, Cre t\'ou uss smooinaghtyn, Vel eh lowal keesh y eeck da Cesar mannagh vel?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 18, 'Agh dennee Yeesey yn foalsaght oc, as dooyrt eh, Cre\'n-fa ta shiu shirrey vondeish y ghoaill orrym, shiuish chrauee-oalsey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 19, 'Jeeagh-jee dou argid y cheesh: as yeeagh ad ping da.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 20, 'As dooyrt eh roo, Quoi ta\'n jalloo as y screeu shoh cowraghey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 21, 'Dooyrt adsyn rish, Cesar. Eisht dooyrt eh roo, Eeck-jee er-y-fa shen da Cesar shen ny ta lesh Cesar: as da Jee, shen ny ta lesh Jee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 22, 'Tra cheayll ad shoh ghow ad yindys as daag ad eh, as hie ad rhymboo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 23, 'Yn laa cheddin haink huggey ny Sadduceeyn, ta gra, Nagh vel irree-seose reesht veih ny merriu dy ve ayn, as denee ad jeh');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 24, 'Gra, Vainshter, ta Moses er ghra, My ta dooinney geddyn baase gyn cloan, dy vel e vraar dy phoosey yn ven echey, as dy hroggal seose sluight gys e vraar.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 25, 'Nish va ny mast\' ain shiaght braaraghyn, as phoose y braar shinney, as geddyn baase gyn cloan, daag eh e ven da e nah vraar.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 26, 'As hooar y nah vraar myrgeddin baase as y trass, gys y chiaghtoo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 27, 'As er-jerrey ooilley hooar y ven baase myrgeddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 28, 'Shen-y-fa ec yn irree-reesht, quoi jeh\'n chiaght vees ee echey son ben, son v\'ee poost roo ooilley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 29, 'Dreggyr Yeesey as dooyrt eh roo, Ta shiu fo marranys, as cha vel toiggal eu jeh goo ny jeh pooar Yee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 30, 'Son ec yn irree-reesht, cha vel ad poosey, ny er nyn goyrt ayns poosey; agh t\'ad myr ainleyn Yee t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 31, 'Agh mychione irree-reesht ny merriu, nagh vel shiu er lhaih shen va loayrit riu liorish Jee, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 32, 'Mish Jee Abraham, as Jee Isaac, as Jee Yacob? cha vel Jee Jee ny merriu, agh Jee ny bioee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 33, 'As tra cheayll y pobble shoh, ghow ad yindys jeh\'n ynsaghey echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 34, 'Agh tra va ny Phariseeyn er chlashtyn dy row eh er chur ny Sadduceeyn nyn dhost, v\'ad er nyn jaglym cooidjagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 35, 'As denee fer jeu ard-ynsit \'sy leigh, question jeh, dy phrowal eh, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 36, 'Vainshter, cre yn ard-anney ayns y leigh?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 37, 'Dooyrt Yeesey rish, Ver oo graih da\'n Chiarn dty Yee lesh ooilley dty chree as lesh ooilley dty annym, as lesh ooilley dt\'aigney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 38, 'Shoh yn chied as yn ard-anney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 39, 'As ta\'n nah anney casley rish, Ver oo graih da dty nahoo myr dhyt hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 40, 'Yn daa anney shoh bun y leigh as ny phadeyryn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 41, 'Choud as va ny Phariseeyn er nyn jaglym cooidjagh, denee Yeesey jeu,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 42, 'Gra, Cre ta nyn smooinaghtyn my chione Creest? quoi da mac eh? Dooyrt adsyn rish, Mac Ghavid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 43, 'Dooyrt eshyn roo, Kys eisht dy vel David liorish yn spyrryd genmys eh ny Hiarn, gra,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 44, 'Dooyrt y Chiarn rish my Hiarn\'s, Soie uss er my laue yesh, derrey neem\'s dty noidyn stoyl dty choshey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 45, 'My ta David eisht genmys eh ny Hiarn, kys t\'eh yn mac echey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 22, 46, 'As cha row dooinney ny vod oc son ansoor y chur da, chamoo by-lhoys da fer erbee jeu (veih\'n laa shen magh) question erbee sodjey y chur huggey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 1, 'Eisht loayr Yeesey rish y pobble, as rish e ostyllyn,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 2, 'Gra, Ta ny scrudeyryn as ny Phariseeyn nyn soie ayns stoyl Voses.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 3, 'Ooilley er-y-fa shen cre-er-bee nee ad y oardaghey diu dy reayll, freill-jee, as jean-jee eh; agh ny jean-jee lurg ny obbraghyn oc: son t\'ad gra, agh cha vel ad jannoo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 4, 'Son t\'ad kiangley erraghyn tromey as doillee dy ve er nyn ymmyrkey, as dyn goyrt ad er geayltyn deiney, agh cha lhie ad hene wheesh mair roo dy hroggal ad.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 5, 'Agh ooilley nyn obbraghyn t\'ad dy yannoo dy ve cronnit liorish deiney: t\'ad jannoo lhean ny phylactereeyn oc, as ceau chemmallyn mooarey er nyn gharmadyn,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 6, 'As shynney lhieu ny ard ynnydyn-soie ec cuirraghyn, as ny ard-stuill ayns ny synagogueyn,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 7, 'As sleih dy vannaghey daue ayns ny margaghyn, as dy ve enmyssit liorish deiney, Rabbi, Rabbi.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 8, 'Agh ny bee-jee shiuish enmyssit Rabbi: son ta un vainshter eu, ta shen dy ghra, Creest, as ta shiuish ooilley nyn mraaraghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 9, 'As ny enmys-jee dooinney erbee ny mast\' eu, Yn ayr: son ta un er ynrycan nyn Ayr, eer eh t\'ayns niau.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 10, 'Chamoo gow-jee erriu dy ve mainshteryn, son ta un er nyn Mainshter, eer Creest.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 11, 'Agh eshyn syrjey ta nyn mast\' eu, bee eh nyn shirveishagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 12, 'Son quoi-erbee ta dy mooaralagh soiaghey seose eh-hene, bee eh er ny injillaghey, agh eshyn ta dy injillaghey eh-hene, bee eh er ny hoiaghey seose.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 13, 'Agh smerg diuish scrudeyryn as Phariseeyn, chrauee oalsey; son ta shiu dooney seose reeriaght niau noi deiney: cha vel shiu goll stiagh shiu hene, as ta shiu dyn lhiettal adsyn ta aggindagh er goll stiagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 14, 'Smerg diu scrudeyryn as Phariseeyn, chrauee-oalsey; son ta shiu cleiy fo thieyn mraane-treoghe, as son scaa dy chraueeaght lhiggey erriu dy ve kinjagh ayns padjer: shen-y-fa ta kerraghey strimmey nyn gour.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 15, 'Smerg diu scrudeyryn as Phariseeyn, chrauee-oalsey; son ta shiu goll mygeayrt keayn as thalloo, dy hayrn agh un yoarree gys y chredjue eu hene, as tra t\'eh er jyndaa hiu, ta shiu dy yannoo eh ny lhiannoo dy niurin ghaa wheesh smessey na shiu hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 16, 'Smerg diu leeideilee doal, ta gra, Quoi-erbee looys liorish y chiamble, nagh vel eh veg: agh quoi-erbee looys liorish airh y chiamble, t\'eh kianlt gys e vreearrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 17, 'O shiuish vee-cheeayllee as doail: son quoi s\'ooasle ta, yn airh, ny\'n chiamble ta casherickey yn airh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 18, 'As quoi-erbee looys liorish yn altar, nagh vel eh veg: agh quoi-erbee looys liorish y gioot t\'er yn altar, t\'eh kianlt gys e vreearrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 19, 'O shiuish vee-cheayllee as doail: son quoi s\'ooasle ta yn gioot, ny\'n altar ta casherickey\'n gioot?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 20, 'Quoi-erbee er-y-fa shen looys liorish yn altar, t\'eh loo liorish yn altar hene, as liorish dy chooilley nhee ta chebbit er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 21, 'As quoi-erbee looys liorish y chiamble, t\'eh loo liorish y chiamble, as liorishyn ta cummal ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 22, 'As eshyn looys liorish niau, t\'eh loo liorish stoyl-reeoil Yee, as liorishyn ta ny hoie er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 23, 'Smerg diu scrudeyryn as Phariseeyn, chrauee-oalsey; son ta shiu geeck jaghee jeh mynthey, anise as cummin, agh cha vel shiu er chooilleeney currymyn s\'ymmyrchee yn leigh, cairys, myghin as firrinys: ad shoh lhisagh shiu v\'er n\'yannoo, fegooish y chooid elley y aagail gyn jannoo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 24, 'Shiuish leeideilee doal, ta sheeley veue yn char-chuilag, agh sluggee shiu camel.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 25, 'Smerg diu scrudeyryn as Phariseeyn, chrauee-oalsey: son ta shiu glenney yn cappan as y claare er cheu-mooie, agh cheu sthie t\'ad lane dy hranlaase as dy neu-heeltys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 26, 'Pharisee ghoal, glen hoshiaght cheu-sthie yn chappan as y chlaare, dy vod y cheu-mooie ve glen myrgeddin');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 27, 'Smerg diu scrudeyryn as Phariseeyn, chrauee-oalsey; son ta shiu goll-rish oaiagh yn t\'er nyn ghiallaghey, ta dy jarroo jeeaghyn aalin er cheu-mooie, agh cheu-sthie t\'ad lane dy chraueyn ny merriu, as jeh dy chooilley eajeeys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 28, 'Shen myr ta shiuish neesht er cheu-mooie cairagh ayns shilley deiney, agh cheu-sthie ta shiu lane dy chraueeaght-oalsey as dy vee-chairys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 29, 'Smerg diu scrudeyryn as Phariseeyn, chrauee oalsey, son dy vel shiu troggal oaiaghyn ny phadeyryn, as soiaghey magh lhiaghtyn ny deiney cairagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 30, 'As gra, Dy beagh shinyn er ve ayns laghyn nyn ayraghyn, cha beagh shin er ve nyn baarteeasyn maroosyn ayns fuill ny phadeyryn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 31, 'Shen-y-fa ta shiu nyn veanishyn noi eu hene, ny nee shiuish yn sluight ocsyn hug ny phadeyryn dy baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 32, 'Lhieen-jee seose eisht towse nyn ayraghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 33, 'Shiuish ard-nieughyn, sheeloghe dy ard-nieughyn, kys oddys shiu kerraghey niurin y scapail?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 34, 'Shen-y-fa, cur-my-ner, ta mish coyrt hiu phadeyryn, as deiney creeney, as scrudeyryn; as paart jeu nee shiu y varroo, as y chrossey, as paart jeu nee shiu y scuitchal ayns nyn guaiylyn, as geiyrt ad veih ard-valley gys ard-valley:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 35, 'Dy vod ooilley yn uill chairagh hie er deayrtey er y thalloo tuittym erriu, veih fuilt Abel cairagh, gys fuill Zecharias, mac Varachias, eh ren shiu y varroo eddyr y chiamble as yn altar.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 36, 'Dy firrinagh ta mee gra riu, Dy jig dy-chooilley nhee jeu shoh er y cheeloghe shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 37, 'O Yerusalem, Yerusalem, uss ta cur dy baase ny phadeyryn, as claghey adsyn t\'er nyn goyrt er chaghteraght hood, cre cha mennick as va mish aggindagh v\'er haglym dty chloan cooidjagh, myr ta kiark goaill stiagh e hein, fo my skianyn, as cha jinnagh shiu!');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 38, 'Cur-my-ner, ta\'n thie eu faagit diu follym-faase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 23, 39, 'Son ta mee gra riu, Nagh vaik shiu mish maghey shoh, derrey jirrys shiu, Bannit ta eshyn ta cheet ayns ennym y Chiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 1, 'As hie Yeesey magh as jimmee eh veih\'n chiamble; as haink e ostyllyn huggey dy ghoaill baght marish jeh aalid y chiamble.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 2, 'As dooyrt Yeesey roo, Nagh vaik shiu ooilley ny reddyn shoh? dy firrinagh ta mee gra riu, Nagh bee faagit un chlagh er clagh elley, nagh bee er ny lhieggal.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 3, 'As myr v\'eh ny hoie er cronk ny Oliveyn, haink e ostyllyn huggey er-lheh, gra, Insh dooin, cuin vees ny reddyn shoh? as cre\'n cowrey vees jeh\'n cheet ayd, as jeh jerrey yn theihll?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 4, 'As dreggyr Yeesey as dooyrt eh roo, Cur-jee twoaie nagh moll dooinney erbee shiu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 5, 'Son hig ymmodee ayns my ennym\'s, gra, Mish yn Creest: as nee ad ymmodee y volley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 6, 'As cluinnee shiu jeh caggaghyn, as jeh imraaghyn dy chaggaghyn: jeeagh nagh bee shiu seaghnit: son shegin da dy chooilley nhee jeu shoh cheet gys kione, agh cha bee yn jerrey foast.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 7, 'Son nee ashoon girree-magh noi ashoon, as reeriaght noi reeriaght: as bee gennaghyn as crampyn, as craaghyn-thallooin ayns ymmodee ynnydyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 8, 'Bee ooilley shoh toshiaght seaghyn diu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 9, 'Eisht livreyee ad shiu seose dy ve seaghnit, as marree ad shiu: as bee dy chooilley ashoon dwoaiagh erriu er coontey yn ennym aym\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 10, 'As eisht nee ymmodee scarrey rish nyn gredjue, as brahee ad, as ver ad feoh yn derrey yeh da\'n jeh elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 11, 'As nee ymmodee phadeyryn-foalsey girree seose, as mooarane y volley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 12, 'As er-yn-oyr dy jean olkys bishaghey, nee graih-ghiastyllagh ymmodee feayraghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 13, 'Agh bee eshyn, nee tannaghtyn firrinagh gys y jerrey, er ny hauail.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 14, 'As bee sushtal yn reeriaght er ny phreacheil ayns ooilley yn seihll, son feanish da dy chooilley ashoon, as eisht nee yn jerrey cheet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 15, 'Tra hee shiu er-y-fa shen eajeeys yn traartys, ta loayrit jeh liorish Daniel y phadeyr, ny hassoo ayns yn ynnyd casherick, (eshyn ta lhaih, lhig da tastey \'ghoaill).');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 16, 'Eisht lhig dauesyn t\'ayns Judea chea gys ny sleityn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 17, 'Eshyn t\'er mullagh y thie, ny lhig da cheet neose dy ghoaill marish nhee erbee ass e hie:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 18, 'As ny lhig dasyn t\'ayns y vagher chyndaa back, dy chur lesh e eaddagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 19, 'As smerg dauesyn ta torragh, as dauesyn ta cur keeagh ayns ny laghyn shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 20, 'Agh guee-jee shiuish nagh bee shiu eginit dy hea ayns y gheurey, ny er y doonaght.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 21, 'Son bee seaghyn mooar ec y traa shen, lheid as nagh row er-dy hoshiaght y theihll gys y traa t\'ayn nish, as lheid as nagh bee dy bragh arragh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 22, 'As mannagh beagh ny laghyn shen dy leah harrish, cha beagh dooinney bio er ny hauail: agh er graih yn chloan reiht, bee ny laghyn shen dy leah harrish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 23, 'Eisht my jir dooinney erbee riu, Cur my-ner, ta Creest ayns shoh, ny ayns shid; ny cred-jee eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 24, 'Son nee Creestyn foalsey, as phadeyryn foalsey girree, as cowraghyn mooarey as yindyssyn y hoilshaghey, ayns wheesh (my oddagh eh ve) dy jinnagh ad molley yn eer chloan reiht.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 25, 'Cur-my-ner, ta mish er n\'insh diu ro laue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 26, 'Shen-y-fa my jir ad riu, T\'eh ayns yn aasagh, ny gow-jee magh: cur-my-ner, t\'eh ayns ny shamyryn follit, ny cred-jee eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 27, 'Son myr ta\'n tendreil cheet ass y shiar, as cur soilshey choud as gys y sheear: myr shen neesht vees cheet Mac y dooinney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 28, 'Son cre-erbee yn raad vees yn convayrt, shen y raad bee ny urlee er nyn jaglym cooidjagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 29, 'Chelleeragh lurg seaghyn ny laghyn shen, hig dorraghys er y ghrian, as cha der yn eayst e soilshey, as tuittee rollageyn yn aer, as bee pooaraghyn yn aer er nyn graa.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 30, 'As eisht bee cowrey Mac y dooinney er ny akin ayns yn aer as ec y traa shen nee ooilley sheelogheyn y thallooin dobberan, as hee ad yn Mac dooinney cheet ayns bodjallyn yn aer, lesh pooar as gloyr vooar.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 31, 'As ver eh magh e ainleyn lesh yn trumpet dy ard-choraa, as nee ad e chloan reiht y haglym cooidjagh veih ny kiare geayghyn, veih\'n derrey ard fo\'n aer gys yn ard elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 32, 'Ynsee-jee eisht coraa-dorraghey veih\'n villey-figgagh: tra ta\'n banglane echey foast oor, as cur magh duillagyn, ta fys eu dy vel y sourey er-gerrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 33, 'Er yn aght cheddin shiuish, tra hee shiu ooilley ny reddyn shoh, toig-jee dy vel eh er-gerrey, dy jarroo ec ny dorryssyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 34, 'Dy firrinagh ta mee gra riu, Cha bee yn cheeloghe shoh harrish, derrey vees dy chooilley nhee jeu shoh cooilleenit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 35, 'Nee yn aer as yn ooir cherraghtyn, agh my ghoan\'s cha jean cherraghtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 36, 'Agh er y laa as yn oor shen, cha vel fys ec dooinney erbee, cha vel ec ainleyn niau, agh ec my Ayr ny-lomarcan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 37, 'Agh myr va laghyn Noe, myr shen myrgeddin vees cheet Mac y dooinney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 38, 'Son myr ayns ny laghyn va roish y thooilley, v\'ad gee as giu, poosey as coyrt ayns poosey, derrey yn laa hie Noe stiagh ayns yn arg,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 39, 'As cha dug ad tastey, derrey haink y thooilley as ghow eh ad ooilley ersooyl; myr shen myrgeddin vees cheet Mac y dooinney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 40, 'Shen y traa vees daa ghooinney ayns y vagher, bee fer goit as fer faagit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 41, 'Bee daa ven blieh ec y wyllin, yn derrey yeh goit, as y jeh elley faagit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 42, 'Shen-y-fa bee-jee er nyn arrey, son cha vel fys eu er yn oor tra hig nyn Jiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 43, 'Agh shoh toig-jee, dy beagh fys er ve ec mainshter y thie cre\'n oor veagh y maarliagh er jeet, veagh eh er e arrey, as cha beagh eh er lhiggey da brishey stiagh er hie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 44, 'Shen-y-fa bee-jee shiuish myrgeddin ullee: son ec lheid yn oor as nagh vel shiu smooinaghtyn er, hig yn Mac dooinney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 45, 'Quoi eisht yn charvaant firrinagh as creeney shen, ta e Hiarn er n\'yannoo ny er reill er e vooinjer, dy chur daue nyn meaghey ayns traa cooie?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 46, 'Bannit ta\'n charvaant cheddin. yiow e Hiarn, tra hig eh, jannoo myr shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 47, 'Dy firrinagh ta mee gra riu, dy livreyee eh gys y churrym echeysyn ooilley e chooid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 48, 'Agh my jir y drogh-harvaant shen ayns e chree, Ta my Hiarn lhiggey shaghey yn cheet echey,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 49, 'As toshiaght y yannoo dy woalley e heshaghyn-sharvaant, as dy ee as dy iu marish ny meshtallee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 50, 'Hig Chiarn y charvaant shen ec laa nagh bee eh jeeaghyn er e hon, as ayns oor nagh bee eh twoaiagh jeh;');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 24, 51, 'As giaree eh eh veih-my-cheilley, as pointee eh e chronney marish ny crauee oalsey: ayns shen vees keayney as snaggeraght feeacklyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 1, 'Eisht bee reeriaght niau er ny hoylaghey gys jeih moidynyn, ghow ny lampyn oc, as hie magh quail y dooinney poosee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 2, 'As va queig jeu creeney, as queig ommijagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 3, 'Hug adsyn va ommijagh lhieu ny lampyn oc, agh cha dug ad lhieu ooil maroo:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 4, 'Agh hug y vooinjer chreeney lhieu ooil ayns ny siyn oc marish nyn lampyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 5, 'Choud as v\'ad fieau er y dooinney poosee, huitt ad ooilley er saveenagh as cadley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 6, 'As ec main-oie va eam er ny choyrt, Cur-my-ner ta\'n dooinney-poosee cheet, gow-jee magh ny whail.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 7, 'Eisht dirree ooilley ny moidynyn shen, as hooar ad aarloo nyn lampyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 8, 'As dooyrt y vooinjer ommijagh rish y vooinjer chreeney, Cur-jee dooinyn jeh\'n ooil euish, son ta ny lampyn ain goll ass.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 9, 'Agh dreggyr y vooinjer chreeney, gra, Cha der; er-aggle nagh bee dy liooar ain dooin hene as diuish neesht: share diu roie hucsyn ta creck, as kionnaghey diu hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 10, 'As choud as v\'ad goll dy chionnaghey haink y dooinney-poosee, as hie yn vooinjer va aarloo stiagh marish gys y vannish, as va\'n dorrys jeight.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 11, 'Ny lurg shen haink ny moidynyn elley gra, Hiarn, Hiarn, foshil dooin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 12, 'Agh dreggyr eshyn as dooyrt eh, Dy firrinagh ta mee gra riu, nagh voddym goaill riu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 13, 'Bee-jee er nyn dwoaie er-y-fa shen son cha vel fys eu er y laa ny\'n oor, nee Mac y dooinney cheet.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 14, 'Son ta reeriaght niau myr dooinney va mysh goaill jurnah gys cheer foddey, deie er e harvaantyn hene, as livrey eh daue e chooid:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 15, 'As da fer hug eh queig talentyn, da fer elley jees, as da fer elley unnane, da dy chooilley ghooinney rere roshtyn e hushtey, as chelleeragh ghow eh e yurnah.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 16, 'Eisht hie yn fer v\'er gheddyn ny queig talentyn, as ren eh dellal lhieu, as chossyn eh queig talentyn elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 17, 'As myrgeddin eshyn v\'er gheddyn jees, chossyn eh neesht jees elley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 18, 'Agh eshyn va lesh yn un talent, hie eh as chleiy eh ayns y thalloo, as dollee eh argid e hiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 19, 'Agh lurg foddey dy hraa haink chiarn ny sharvaantyn shen, as ren eh coontey roo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 20, 'As haink eshyn v\'er gheddyn ny queig talentyn, as hug eh lesh queig talentyn elley, gra, Hiarn, livrey uss dooys queig talentyn: cur-my-ner, ta mee er chosney queig talentyn elley lhieu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 21, 'Dooyrt e hiarn rish, S\'mie t\'ou er n\'yannoo, harvaant vie as firrinagh; t\'ou er ny ve firrinagh ayns y veggan, livrey-yms mooarane gys dty churrym: immee uss stiagh gys boggey dty hiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 22, 'Haink eshyn myrgeddin v\'er gheddyn yn daa halent, as dooyrt eh, Hiarn, livrey uss dooys daa halent: cur-my-ner, ta mee er chosney daa halent elley lhieu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 23, 'Dooyrt e hiarn rish, S\'mie t\'ou er n\'yannoo, harvaant vie as firrinagh: t\'ou er ny ve firrinagh ayns y veggan, livrey-yms mooarane gys dty churrym: immee uss stiagh gys boggey dty hiarn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 24, 'Agh y fer v\'er gheddyn yn un talent haink eh, as dooyrt eh, Hiarn, va fys aym\'s dy nee dooinney creoi oo; buinn raad nagh ren oo cuirr, as chaglym raad nagh ren oo skeayley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 25, 'As ghow mee aggle, as hie mee as dollee mee dty halent ayns y thalloo: jeeagh, shoh dhyt dty chooid hene.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 26, 'Dreggyr e hiarn, as dooyrt eh rish, Harvaant vee-chairagh as neu-harroogh, va fys ayd\'s dy row mish buinn raad nagh ren mee cuirr, as chaglym raad nagh ren mee skeayley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 27, 'Lhisagh oo er-y-fa shen v\'er chur my argid magh er-use, as eisht tra harrin, oddin v\'er gheddyn my chooid hene lesh bishaghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 28, 'Gow-jee er-y-fa shen yn talent veihsyn, as cur-jee eh dasyn ta jeih talentyn echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 29, 'Son da dy chooilley ghooinney ta kuse echey vees er ny choyrt, as yiow eh ny smoo: agh veihsyn nagh vel echey vees er ny ghoaill ersooyl eer shen ny ta echey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 30, 'As tilg-jee yn charvaant neu-harroogh ayns y dorraghys sodjey-mooie: ayns shen vees keayney as snaggeraght feeacklyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 31, 'Tra hig Mac y dooinney ayns e ghloyr, as ooilley e ainleyn casherick marish, shen y traa hoie-ys eh er stoyl-reeoil e ghloyr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 32, 'As kiongoyrt rish vees dy chooilley ashoon er nyn jaglym; as scarree eh ad veih-my-cheilley, myr ta bochilley scarrey eddyr e chirree as ny goair:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 33, 'As soie-ee eh ny kirree er e laue-yesh, agh ny goair er e laue-chiare.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 34, 'Eisht jir y ree roosyn er e laue-yesh, Tar-jee chloan vannit my Ayrey, gow-jee eiraght \'sy reeriaght ta kiarit diu er-dy hoshiaght y theihll.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 35, 'Son va mee accryssagh, as hug shiu beaghey dou: va mee paagh, as hug shiu jough dou: va mee my yoarree, as ghow shiu stiagh mee:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 36, 'Rooisht, as ren shiu m\'y choamrey: va mee ching, as haink shiu dy my yeeaghyn: va mee ayns pryssoon, as haink shiu hym.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 37, 'Eisht nee\'n chloan chairagh eh y reggyrt, gra, Hiarn, cuin honnick shin oo accryssagh, as dy dug shin beaghey dhyt? ny paagh, as dy dug shin jough dhyt?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 38, 'Cuin honnick shin oo dty yoarree, as dy-ghow shin stiagh oo? ny rooisht, as dy ren shin dty choamrey?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 39, 'Ny cuin honnick shin oo ching, ny ayns pryssoon, as dy daink shin dy dty yeeaghyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 40, 'As freggyree yn Ree, as jir eh roo, Dy firrinagh ta mee gra riu, Ayns wheesh as dy vel shiu er n\'yannoo eh son y fer sloo jeu shoh my vraaraghyn, ta shiu er n\'yannoo eh er my hon\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 41, 'Eisht jir eh roosyn myrgeddin er y laue-chiare, Immee-jee voym, chloan churstey gys yn aile dy bragh farraghtyn, kiarit son y drogh-spyrryd as e ainleyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 42, 'Son va mee accryssagh, as cha dug shiu beaghey dou: va mee paagh, as cha dug shiu jough dou:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 43, 'Va mee my yoarree, as cha ghow shiu stiagh mee: rooisht, as cha ren shiu m\'y choamrey: ching, as ayns pryssoon, as cha daink shiu dy my yeeaghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 44, 'Eisht nee adsyn myrgeddin eh y reggyrt, gra, Hiarn, cuin honnick shin oo accryssagh, ny paagh, ny dty yoarree, ny rooisht, ny ching, ny ayns pryssoon, as nagh chooin shin lhiat?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 45, 'Eisht nee eh nyn reggyrt, gra, Dy firrinagh ta mee gra riu, Ayns wheesh as nagh ren shiu eh son unnane jeh\'n vooinjer sloo jeu shoh, cha ren shiu eh er my hon\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 25, 46, 'As hed ad shoh ersooyl gys y kerraghey dy bragh farraghtyn: agh y chloan chairagh gys y vea veayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 1, 'As haink eh gy-kione erreish da Yeesey ve er loayrt ooilley ny goan shoh, dy dooyrt eh rish e ostyllyn,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 2, 'Ta fys eu lurg daa laa dy bee feailley ny caisht, as dy bee yn Mac dooinney er ny vrah dy ve er ny chrossey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 3, 'Eisht va ny ard-saggyrtyn as ny scrudeyryn as shanstyr y phobble er nyn jaglym cooidjagh gys thie yn ard-saggyrt va enmyssit Caiaphas.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 4, 'As hug ad nyn goyrle dy cheilley, my chione Yeesey y ghoaill dy follit, as dy choyrt eh gy-baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 5, 'Agh dooyrt ad, Cha nee er laa ny feailley, er-aggle dy bee irree-magh ayn mastey\'n pobble.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 6, 'Nish tra va Yeesey ayns Bethany, ayns thie Simon yn lourane,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 7, 'Haink huggey ben lesh box alabaster dy ooil feer chostal, as gheayrt ee eh er e chione, myr v\'eh ny hoie ec bee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 8, 'Agh tra honnick e ostyllyn shoh, v\'ad jymmoosagh, gra, Cre\'n-fa va\'n jummal shoh jeant?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 9, 'Son oddagh yn ooil shoh v\'er ny ve creckit son mooarane, as er ny choyrt da ny boghtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 10, 'Tra hoig Yeesey shoh, dooyrt eh roo, Kys dy vel shiu boirey yn ven? son t\'ee er n\'yannoo obbyr vie orrym\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 11, 'Son ta ny boghtyn eu kinjagh meriu, agh mish cha vel eu kinjagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 12, 'Son liorish dy vel ee er gheayrtey yn ooil shoh er n y chorp, t\'ee er n\'yannoo eh cour my oanluckey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 13, 'Dy firrinagh ta mee gra riu, Cre theihll y raad vees yn sushtal shoh er ny phreacheil, dy bee shoh myrgeddin ta\'n ven shoh er n\'yannoo, er ny imraa ayns cooinaghtyn j\'ee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 14, 'Eisht hie fer jeh\'n daa ostyl yeig, va enmyssit Yuaase Iscariot, gys ny ard-saggyrtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 15, 'As dooyrt eh roo, Cre ver shiu dooys, as livrey-ym diuish eh? As choard ad rish son jeih peeshyn as feed dy argid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 16, 'As veih\'n traa shen v\'eh shirrey caa dy vrah eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 17, 'Nish er y chied laa jeh feailley yn arran-caisht, haink e ostyllyn gys Yeesey as dooyrt ad rish, Cre\'n raad sailt shin dy yannoo aarloo er dty hon dy ee yn eayn caisht?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 18, 'As dooyrt eh, Gow-jee gys yn ard-valley gys lheid y dooinney shen, as abbyr-jee rish, Ta\'n mainshter gra, Ta my hraa er gerrey, freill-ym y chaisht ec dty hie\'s marish my ostyllyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 19, 'As ren adsyn myr va Yeesey er n\'oardaghey daue, as daarlee ad yn eayn-caisht.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 20, 'Nish tra va\'n fastyr er-jeet, hoie eh sheese marish yn daa ostyl yeig.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 21, 'As myr v\'ad gee, dooyrt eh, Dy firrinagh ta mee gra riu, dy jean fer jiuish mish y vrah.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 22, 'As v\'ad dy mooar seaghnit, as ren ad toshiaght dagh fer jeu dy ghra rish, Hiarn, nee orrym\'s t\'ou cheet?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 23, 'As dansoor eshyn, gra, eshyn ta thummey e laue marym ayns y chlaare, eh shen nee mish y vrah.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 24, 'Ta Mac y dooinney goll, myr te scruit jeh: agh smerg da\'n dooinney shen liorish vees Mac y dooinney er ny vrah: s\'mie veagh eh son y dooinney shen mannagh row eh rieau er jeet er y theihll.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 25, 'Eisht dansoor Yuaase, ren y vrah eh, as dooyrt eh, Vainshter, nee mish eh? Dooyrt eshyn rish, T\'ou er ghra eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 26, 'As myr v\'ad gee, ghow Yeesey arran as vannee eh as vrish eh eh, as hug eh eh da ny ostyllyn, gra, Gow-jee, ee-jee, shoh my chorp\'s.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 27, 'As ghow eh yn cappan, as hug eh booise, as hug eh eh daue, gra, iu-jee ooilley jeh shoh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 28, 'Son shoh my uill\'s jeh\'n conaant noa, t\'er ny gheayrtey son ymmodee son leih peccaghyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 29, 'Agh ta mee gra riu, Nagh n\'iu-ym maghey shoh jeh mess y villey-feeyney, derrey\'n laa iu-ym eh ass-y-noa meriu ayns reeriaght my Ayrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 30, 'As tra v\'ad er ghoaill arrane-moyllee hie ad magh gys cronk ny Oliveyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 31, 'Eisht dooyrt Yeesey roo, Failee yn credjue euish ooilley noght kyndagh rhym\'s: son te scruit, Bwoaill-ym\'s yn bochilley, as bee kirree yn chioltane er nyn skeayley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 32, 'Agh erreish dou v\'er n\'irree reesht, hem reu gys Galilee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 33, 'Dansoor Peddyr as dooyrt eh rish, Ga dy vaill credjue dy chooilley ghooinney kyndagh rhyt\'s, cha vaill my chredjue\'s dy bragh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 34, 'Dooyrt Yeesey rish, Dy firrinagh ta mee gra rhyt , Noght hene roish gerrym chellee, dy nob uss mish three keayrtyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 35, 'Dooyrt Peddyr rish, Dy beign dou goll dy baase mayrt, cha nobbin oo. As er yn aght cheddin loayr ooilley ny ostyllyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 36, 'Eisht haink Yeesey maroo gys ynnyd va enmyssit Gethsemane, as dooyrt eh rish ny ostyllyn, Soie-jee shiuish ayns shoh, choud as hem\'s gys padjer \'sy voayl shid.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 37, 'As ghow eh marish Peddyr, as daa vac Zebedee, as ren eh toshiaght dy ve trimshagh as trome-chreeagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 38, 'Eisht dooyrt eh roo, Ta my annym feer trimshagh, dy jarroo gys y baase: fuirree-jee ayns shoh as freill-jee arrey marym.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 39, 'As hie eh red beg sodjey, as huitt eh sheese er e eddin, as ghow eh padjer, as dooyrt eh, O my Ayr, my oddys eh \'ve, lhig da\'n cappan shoh goll shagh-ym: ny-yeih cha nee m\'aigney\'s, agh dty aigney\'s dy row jeant.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 40, 'As haink eh gys ny ostyllyn, as hooar eh ad nyn gadley, as dooyrt eh rish Peddyr, Kys ta shoh, nagh voddagh shiu arrey y reayll marym un oor?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 41, 'Bee-jee er nyn dwoaie as gow-jee padjer, nagh duitt shiu ayns miolagh: ta\'n spyrryd dy jarroo arryltagh, agh ta\'n eill annoon.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 42, 'Hie eh roish reesht yn nah cheayrt, as ghow eh padjer, gra, O my Ayr, mannagh vod yn cappan shoh goll shagh-ym, fegooish mee dy iu eh, dty aigney\'s dy row jeant.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 43, 'As haink eh as hooar eh ad nyn gadley reesht: son va ny sooillyn oc trome.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 44, 'As daag eh ad, as hie eh roish reesht as ghow eh padjer yn trass cheayrt, gra ny goan cheddin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 45, 'Eisht haink eh gys e ostyllyn, as dooyrt eh roo, Caddil-jee nish, as gow-jee nyn vea; cur-my-ner ta\'n oor tayrn er-gerrey, as ta\'n Mac dooinney er ny vrah gys laueyn peccee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 46, 'Irree-jee, as lhig dooin goll: cur-my-ner t\'eshyn er-gerrey dooin ta dy my vrah.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 47, 'As choud as v\'eh foast loayrt, cur my-ner, haink Yuaase, fer jeh\'n daa ostyl yeig, as va sheshaght vooar marish lesh cliwenyn as luirg veih ny ard-saggyrtyn as shanstyr y phobble');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 48, 'Nish hug eshyn v\'er vrah eh, cowrey daue, gra, Quoi-erbee ver-yms paag da, shen eh, cum-jee eh dy shickyr.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 49, 'As chelleeragh haink eh gys Yeesey, as dooyrt eh, Dy vannee dhyt, Vainshter; as phaag eh eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 50, 'As dooyrt Yeesey rish, My heshey, cre\'n-fa t\'ou er jeet? Eisht haink ad, as ghreimm ad er Yeesey, as ghow ad eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 51, 'As cur-my-ner heeyn fer jeusyn va marish Yeesey magh e laue, as hayrn eh e chliwe, as woaill eh fer-mooinjerey yn ard saggyrt, as ghiare eh yn chleaysh jeh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 52, 'Eisht dooyrt Yeesey rish, Cur seose dty chliwe reesht \'sy fine: son nee adsyn ooilley ta goaill y cliwe, cherraghtyn liorish y chliwe.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 53, 'Vel uss smooinaghtyn nagh voddym\'s nish guee gys my Ayr, as yinnagh eh chelleeragh hym erskyn daa legion jeig dy ainleyn?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 54, 'Agh kys eisht vees ny scriptyryn er nyn gooilleeney, dy nee shoh myr te dy ve?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 55, 'Ayns yn oor cheddin dooyrt Yeesey rish y pobble, Vel shiu er jeet magh myr noi maarliagh, lesh cliwenyn as luirg dy my ghoaill? hoie mee meriu gagh-laa gynsaghey ayns y chiamble, as cha ren shiu my ghoaill.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 56, 'Agh va ooilley shoh jeant, dy voddagh scriptyryn ny phadeyryn ve cooilleenit. Eisht ren ooilley ny ostyllyn treigeil eh, as cosney roue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 57, 'As leeid y vooinjer v\'er ghoaill Yeesey eh ersooyl gys Caiaphas yn ard saggyrt, raad va ny scrudeyryn as y chanstyr er nyn jaglym cooidjagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 58, 'Agh deiyr Peddyr er foddey ny yei, gys thie yn ard-saggyrt, as hie eh stiagh, as hoie eh marish y vooinjer dy yeeaghyn cre\'n erree harragh er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 59, 'Nish yn ny ard-saggyrtyn as y chanstyr as ooilley yn choonceil, shirrey feanishyn foalsey noi Yeesey dy choyrt eh gy-baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 60, 'Agh cha dooar ad veg: ga dy daink ymmodee feanishyn foalsey, foast cha dooar ad veg. Ec y jerrey haink daa eanish foalsey,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 61, 'As dooyrt ad, T\'eh shoh er ghra, Ta\'n phooar aym\'s dy lhieggal chiamble Yee, as dy hroggal eh reesht ayns three laa.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 62, 'As hass yn ard-saggyrt seose, as dooyrt eh rish, Nagh vel oo cur ansoor? cre shoh t\'ad dy lhiassaghey dt\'oi?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 63, 'Agh va Yeesey ny-host. As dreggyr yn ard-saggyrt as dooyrt eh rish, Ta mee cur currym ort liorish y Jee bio, oo dy insh dooin, nee oo yn Creest mac Yee?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 64, 'Dooyrt Yeesey rish, T\'ou uss er ghra eh: ny-yeih ta mish gra riu, Ny lurg shoh hee shiu Mac y dooinney ny hoie er laue yesh yn phooar, as cheet ayns bodjallyn yn aer.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 65, 'Eisht raip yn ard-saggyrt e choamrey, gra, ren er loayrt goan mollaghtagh, cre\'n feme sodjey t\'ain er feanishyn? cur-my-ner, nish ta shiu er chlashtyn e ghoan mollaghtagh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 66, 'Cre ta shiu smooinaghtyn jeh? Dansoor ad, as dooyrt ad, T\'eh toilchin dy ve er ny choyrt gy-baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 67, 'Eisht cheau ad shellaghyn ayns e eddin, as woaill ad eh, as woaill feallagh elley eh lesh bassyn nyn laueyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 68, 'Gra, Jean phadeyrys dooin, uss yn Creest, quoi ta dy dty woalley?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 69, 'Nish va Peddyr ny hoie cheu-mooie jeh\'n cheshaght ayns y halley: as haink ben aeg huggey, gra, V\'ou uss myrgeddin marish Yeesey dy Ghalilee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 70, 'Agh dob eh kiongoyrt roo ooilley, gra, Cha s\'aym cre t\'ou dy ghra.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 71, 'As tra v\'eh er gholl magh ayns y phorch, honnick ben-aeg elley eh, as dooyrt ee roosyn v\'ayns shen, V\'eh shoh myrgeddin marish Yeesey dy Nazareth.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 72, 'As reesht dob eh lesh loo, Cha nione dou yn dooinney.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 73, 'As tammylt ny lurg shen haink huggey paart jeh\'n cheshaght, as dooyrt ad rish Peddyr, Shickyr she fer jeu oo, son ta dty ghlare dy dty vrah.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 74, 'Eisht ren eh toshiaght dy ghweeaghyn as dy loo, gra, Cha nione dou yn dooinney. As chelleeragh ren y kellagh gerrym.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 26, 75, 'As chooinee Peddyr er ny goan va Yeesey er ghra rish, Roish gerrym y chellee, obbee uss mish three keayrtyn. As hie eh magh as cheayn eh dy sharroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 1, 'Tra va\'n moghrey er jeet rish, hug ooilley ny ard-saggyrtyn as shanstyr yn phobble nyn goyrle dy cheilley, dy choyrt eh gy-baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 2, 'As erreish daue v\'er chiangley eh, leeid ad eh ersooyl, as livrey ad eh gys Pontius Pilate yn kiannoort,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 3, 'Tra honnick eisht Yuaase ren y vrah eh, dy row eh er ny gheyrey, ghow eh arrys, as hug eh lesh reesht ny jeih peeshyn as feed dy argid gys ny ard-saggyrtyn as y chanstyr,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 4, 'Gra, Ta mee er n\'yannoo peccah, ayns dy vel mee er vrah yn uill neu-chyndagh. As dooyrt adsyn, Cre ta shen dooinyn? jeeagh uss da shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 5, 'As hilg eh sheese ny peeshyn argid ayns y chiamble, as jimmee eh roish, as hie eh as ren eh eh-hene y chroghey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 6, 'As ghow ny ard-Saggyrtyn ny peeshyn argid, as dooyrt ad, Cha vel eh lowal dy choyrt ad mastey tashtaghyn y chiamble er-yn-oyr dy nee leagh foalley t\'ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 7, 'As ghow ad coyrle, as chionnee ad lhieu magher yn phasheyder, dy oanluckey joarreeyn ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 8, 'Shen-y-fa va\'n magher shen enmyssit, Yn magher-foalley, gys y laa t\'ayn jiu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 9, '(Shen y traa va cooilleenit ny va loayrit liorish Jeremy yn phadeyr, gra, As ghow ad ny jeih peeshyn as feed dy argid, yn phrice echeysyn v\'er ny phriceil, eshyn hug cloan Isra price er:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 10, 'As hug ad ad son magher yn phasheyder, myr va\'n Chiarn er n\'oardaghey dou).');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 11, 'As hass Yeesey fenish y chiannoort, as denee yn kiannoort jeh, gra, Nee uss ree ny Hewnyn? As dooyrt Yeesey rish, T\'ou uss dy ghra eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 12, 'As tra v\'eh er ny chassid liorish ny ard-saggyrtyn as y chanstyr, cha dug eh ansoor erbee daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 13, 'Eisht dooyrt Pilate rish, Nagh vel oo clashtyn cre whilleen red t\'ad shoh cur stiagh');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 14, 'As cha dug eh un ockle dy ansoor da, ayns wheesh as dy ghow yn kiannoort yindys mooar.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 15, 'Nish ec y feailley shen va\'n kiannoort cliaghtey feaysley daue pryssoonagh erbee dy bailloo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 16, 'As va oc ec y traa shen ard-phryssoon agh va enmyssit Barabbas.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 17, 'Shen-y-fa tra v\'ad er nyn jaglym cooidjagh, dooyrt Pilate roo, Quoi sailliu mee dy eaysley diu? Barabbas, ny Yeesey, ta enmyssit Creest?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 18, 'Son va fys echey dy nee ayns goanlys v\'ad er chur stiagh eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 19, 'Erreish da soie er stoyl y vriwnys, hug e ven fys huggey, gra, Ny bee veg ayd\'s dy yannoo rish y dooinney cairagh shen: son s\'mooar ta mee er hurranse jiu ayns my chadley, er y choontey echeysyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 20, 'Agh choyrlee ny ard-saggyrtyn as shanstyr y phobble ad dy yannoo aghin son Barabbas, as Yeesey y choyrt gy-baase.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 21, 'Dansoor y kiannoort as dooyrt eh roo, Quoi jeh\'n jees sailliu mee dy eaysley diu? Dooyrt adsyn, Barabbas.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 22, 'Dooyrt Pilate roo, Cre nee\'m eisht rish Yeesey, ta enmyssit Creest? Dooyrt ad ooilley rish, Lhig da v\'er ny chrossey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 23, 'As dooyrt y kiannoort, Cre\'n-oyr, cre\'n olk t\'eh er n\'yannoo? Agh deie adsyn ny smoo, gra, Lhig da v\'er ny chrossey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 24, 'Tra honnick Pilate nagh dug ad geill da e choyrle, agh dy row ad aarloo dy irree-magh, ghow eh ushtey, as niee eh e laueyn kiongoyrt rish y pobble, gra, Ta mish neu-chyndagh jeh fuill yn phersoon cairagh shen, jeeagh-jee shiuish da.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 25, 'Eisht dansoor ooilley yn pobble, gra, Yn uill echey dy row orrinyn, as er nyn gloan.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 26, 'Eisht deayshil eh Barabbas daue; as erreish da Yeesey ve scuitchit, hug eh briwnys er dy v\'er ny chrossey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 27, 'Eisht hug sidooryn y chiannoort lhieu Yeesey gys halley ny briwnys, as deie ad er slane sheshaght ny sidooryn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 28, 'As rooisht ad eh, as hug ad er coamrey scarleod.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 29, 'As fee attey dy ghrineyn hug ad eh mysh e chione, as cuirtlagh ayns e laue-yesh: as gliooney kiongoyrt rish dooyrt ad ayns craid, Dy vannee dhyt, Ree ny Hewnyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 30, 'As cheau ad shellaghyn er, as ghow ad y chuirtlagh, as woaill ad eh er y chione');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 31, 'As erreish daue v\'er n\'yannoo (nyn saie) craid er, ghow ad yn coamrey reeoil jeh as hug ad e gharmad hene er, as leeid ad eh ersooyl dy chrossey eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 32, 'As myr haink ad magh, hooar ad dooinney jeh Cyrene, enmyssit Simon: eshyn ren ad y eaginaghey dy ymmyrkey e chrosh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 33, 'As tra v\'ad er jeet gys ynnyd ta enmyssit Golgotha, ta shen dy ghra, Ynnyd bollag.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 34, 'Hug ad da vinegar dy iu, as gall ny-chione: as tra v\'eh er vlashtyn eh, cha baillish giu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 35, 'As ren ad eh y chrossey, as rheynn ad e gharmadyn, tilgey lottyn: as shoh myr va cooilleenit shen loayr y phadeyr, Rheynn ad my gharmadyn nyn mast\' oc, as er my chooat ren ad lottyn y hilgey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 36, 'As hoie ad sheese as dreill ad arrey er ayns shen.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 37, 'As hoie ad erskyn e chione oyr e vaaish scruit, SHOH YEESEY REE NY HEWNYN.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 38, 'Eisht va daa vaarliagh er ny chrossey marish: yn derrey yeh er y laue-yesh, as y jeh elley er y laue-chiare.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 39, 'As doltooan y vooinjer va goll shaghey eh, craa nyn ghing.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 40, 'As gra, Uss ta lhieggal y chiamble, as dy hroggal eh reesht ayns three laa, saue oo hene: my she mac Yee oo, tar neose jeh\'n chrosh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 41, 'Myr shen neesht ren ny ard saggyrtyn craidey mysh, marish ny scrudeyryn as y chanstyr, as dooyrt ad,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 42, 'Haue eh feallagh elley, eh-hene cha vod eh sauail: my she ree Israel eh, lhig da cheet neose jeh\'n chrosh, as nee mayd credjal ayn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 43, 'Hreisht eh ayns Jee; lhig da eh y livrey nish my saillish eh: son dooyrt eh, She mac Yee mee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 44, 'Hilg ny maarlee myrgeddin v\'er nyn grossey marish yn lheid cheddin er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 45, 'Nish veih yn cheyoo oor, va dorraghys harrish ooilley yn cheer, gys yn nuyoo oor.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 46, 'As mygeayrt yn nuyoo oor, deie Yeesey lesh ard-choraa, gra, ELI, ELI, LAMA SABACTHANI? ta shen dy ghra, My Yee, My Yee, cre\'n-fa t\'ou er my hreigeil?');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 47, 'Dooyrt paart jeusyn va nyn shassoo ayns shen, tra cheayll ad shen, Ta\'n dooinney shoh geamagh er Elias.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 48, 'As chelleeragh roie fer jeu, as ghow eh sponge as lhieen eh eh lesh vinegar, as hug eh eh er cuirtlagh, as heeyn eh eh huggey dy iu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 49, 'Dooyrt y vooinjer elley, Faag-jee veue eh, hee mayd jig Elias dy hauail eh.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 50, 'Tra va Yeesey er n\'eamagh reesht lesh ard-choraa, phaart eh..');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 51, 'As cur-my-ner, va\'n coodaghey va eddyr, y chiamble as yn ynnyd casherick raipit veih-my-cheilley, veih\'n vullagh gys y laare; as ren y thalloo craa, as ny creggyn scoltey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 52, 'As va ny oaiaghyn er nyn vosley, as ren ymmodee jeh kirp ny nooghyn va nyn gadley, girree seose,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 53, 'As cheet ass ny oaiaghyn oc lurg yn irree-seose-reesht echey, hie ad stiagh ayns yn ard-valley casherick, as hoilshee ad ad hene da ymmodee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 54, 'Nish tra honnick yn captan, as adsyn va marish freayll arrey er Yeesey, yn craa thallooin, as ny reddyn v\'er jeet gy-kione, ghow ad aggle mooar, gra, Dy firrinagh shoh va Mac Yee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 55, 'As va ymmodee mraane ayns shen (va jeeaghyn er tammylt voue) va er n\'eiyrt er Yeesey veih Galilee dy hirveish er.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 56, 'Nyn mast\' oc va Moirrey Malaine, as Moirrey moir Yamys as Voses, as moir cloan Zebedee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 57, 'Tra va\'n fastyr er jeet, haink dooinney berchagh ass Arimathea, va enmyssit Joseph va myrgeddin eh-hene credjal ayns Yeesey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 58, 'Hie eh shoh gys Pilate, as ren eh aghin son corp Yeesey: eisht doardee Pilate yn corp dy ve er ny livrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 59, 'As tra va Joseph er n\'ghoaill y corp hoill eh eh ayns aanrit glen,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 60, 'As doanluck eh eh ayns yn oaie noa echey hene, v\'eh er chleiy ass y chreg: as rowl eh clagh vooar er beeal yn oaie, as jimmee eh roish.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 61, 'As va Moirrey Malaine, as Moirrey elley, nyn soie jeeragh er yn oaie.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 62, 'Nish yn nah laa lurg laa yn aarlaghey haink ny ard-saggyrtyn as ny Phariseeyn cooidjagh gys Pilate,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 63, 'Gra, Vainshter, ta cooinaghtyn ain dy dooyrt yn molteyr shen, choud as v\'eh foast bio, Lurg three laa neem\'s girree reesht.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 64, 'Cur sarey er-y-fa shen yn oaie dy ve jeant shickyr, derrey yn trass laa, er-aggle dy jig e ostyllyn ayns yn oie, as dy geid ad eh ersooyl, as dy jir ad rish yn pobble, T\'eh er n\'irree veih ny merriu: myr shen bee yn molteyrys s\'jerree ny smessey na\'n chied volteyrys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 65, 'Dooyrt Pilate roo, Ta watch eu immee-jee reue, jean-jee cha shickyr jeh as oddys shiu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 27, 66, 'Myr shen hie ad, as ren ad yn oaie shickyr, sealal y chlagh, as soiaghey watch.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 1, 'Tra va\'n doonaght harrish, as y vadran cheet rish er y chied laa jeh\'n chiaghtin, haink Moirrey Malaine, as Moirrey elley dy voddagh ad yn oaie y akin.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 2, 'As cur-my-ner va craa thallooin mooar ayn; son va ainle y Chiarn er jeet neose veih niau, as er jeet as er rowlal back yn chlagh jeh beeal yn oaie, as er hoie urree.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 3, 'Va\'n eddin echey goll-rish y tendreil, as e choamrey gial myr y sniaghtey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 4, 'As ayns aggle roish va ny arreyderyn er creau, as haink ad dy ve myr deiney marroo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 5, 'As dreggyr yn ainle, as dooyrt eh rish ny mraane, Ny gow-jee aggle: son ta fys aym\'s dy vel shiu shirrey Yeesey, v\'er ny chrossey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 6, 'Cha vel eh ayns shoh, son t\'eh er n\'irree myr dooyrt eh-hene: tar-jee, jeeagh-jee er yn ynnyd raad va\'n Chiarn oanluckit.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 7, 'As immee-jee dy tappee, as insh-jee da e ostyllyn, dy vel eh er n\'irree veih ny merriu; as cur-my-ner, t\'eh goll reue gys Galilee, ayns shen hee shiu eh, cur-my-ner, ta mish er n\'insh diu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 8, 'As jimmee ad dy tappee veih\'n oaie lesh aggle as boggey mooar, as roie ad dy chur lhieu yn naight gys e ostyllyn.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 9, 'As myr v\'ad goll dy insh eh da e ostyllyn, cur-my-ner haink Yeesey nyn guail, gra, Dy vannee diu. As haink ad, as huitt ad sheese ec e chassyn, lesh nyn laueyn orroo, cur ooashley da.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 10, 'Eisht dooyrt Yeesey roo, Ny gow-jee aggle: immee-jee, as abbyr-jee rish my vraaraghyn ad dy gholl gys Galilee, as ayns shen hee ad mee.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 11, 'Nish myr v\'ad goll, cur-my-ner, haink shiartanse jeh\'n arrey gys yn ard-valley, as dinsh ad da ny ard-saggyrtyn ooilley ny va er daghyrt.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 12, 'As tra v\'adsyn as y chanstyr er nyn jaglym cooidjagh, as er chur nyn goyrle dy cheilley hug ad sym mooar dy argid da ny sidooryn,');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 13, 'Gra, Abbyr-jee shiuish, Haink e ostyllyn ayns yn oie, as gheid ad eh ersooyl choud as va shin nyn gadley.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 14, 'As my chlinnys y kiannoort jeh, nee mayd eshyn y vreagey as shiuish y heyrey.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 15, 'Myr shen ghow ad yn argid, as ren ad myr va currit roue: as ta\'n raa shoh dy cadjin er ny insh magh mastey ny Hewnyn gys y laa t\'ayn jiu.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 16, 'Eisht hie yn un ostyl yeig roue gys Galilee, gys slieau raad va Yeesey er n\'oardaghey daue.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 17, 'As tra honnick ad eh, hug ad ooashley da: agh va paart jeu fo mee-ourys.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 18, 'As haink Yeesey, as loayr eh roo, gra, Ta dy chooilley phooar er ny chur dou ayns niau as er y thalloo.');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 19, 'Immee-jee er-y-fa shen, as ynsee-jee dy chooilley ashoon, as bashtee-jee ad ayns ennym yn Ayr, as y Vac, as y spyrryd Noo:');
INSERT INTO `ManxGaelic_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (40, 28, 20, 'Gynsaghey daue dy reayll dy chooilley nhee cre-erbee ta mish er chur ayns sarey diu: as cur-my-ner, ta mish meriu kinjagh, eer gys jerrey yn theihll.');
